INSERT INTO "quiz_level" VALUES(1,'Hobbyist/Professional',2,'2013-03-20 15:42:04','2013-03-20 15:42:04');
INSERT INTO "quiz_level" VALUES(3,'Expert',3,'2013-03-20 15:58:59','2013-03-20 15:58:59');
INSERT INTO "quiz_level" VALUES(4,'Nightmare',4,'2013-03-20 16:00:00','2013-03-20 16:00:00');
INSERT INTO "quiz_level" VALUES(5,'Level 1',1,'2014-11-03 00:00:20.182517','2014-11-03 00:00:20.182540');
INSERT INTO "quiz_question" VALUES(1,'What does MODEM stand for?','network',1,'','The MODEM converts the Telephone signal to internet packets and Vice - versa, hence it is known as a MODULATOR - DEMODULATOR.',1,'2017-05-12 02:35:15.628224','2017-05-12 02:35:15.628231');
INSERT INTO "quiz_question" VALUES(2,'Which of these represents 1,000,000,000,000,000,000 bytes?','os',1,'','1 EB = 1,000,000,000,000,000,000 bytes (10^18 bytes) or a billion gigabytes.',1,'2017-05-12 02:35:15.741285','2017-05-12 02:35:15.741306');
INSERT INTO "quiz_question" VALUES(3,'What does the ''mkdir'' command do in Linux operating systems?','linux',1,'','The ''mkdir'' command creates a directory (or folder). ''mkdir'' is short for ''make directory''.',1,'2017-05-12 02:35:15.860085','2017-05-12 02:35:15.860093');
INSERT INTO "quiz_question" VALUES(4,'What is the command ''mkdir'' short for in Linux?','linux',1,'','The ''mkdir'' command creates a directory (or folder). ''mkdir'' is short for ''make directory''.',1,'2017-05-12 02:35:15.968124','2017-05-12 02:35:15.968131');
INSERT INTO "quiz_question" VALUES(5,'What does BIOS stand for?','os',1,'','The fundamental purposes of the BIOS are to initialize and test the system hardware components, and to load an operating system.',1,'2017-05-12 02:35:16.018726','2017-05-12 02:35:16.018733');
INSERT INTO "quiz_question" VALUES(6,'Which is NOT an Operating System?','os',1,'','Microsoft Office XP is a suite of desktop applications, including text editor, spreadsheet editor, etc, NOT an operating system.',1,'2017-05-12 02:35:16.077753','2017-05-12 02:35:16.077760');
INSERT INTO "quiz_question" VALUES(7,'How many bytes are in one kilobyte (kB)?','os',1,'','1 kilobyte (kB - lowercase k, uppercase B) is 1000 bytes, whereas 1 kibibyte (KiB) is 1024 bytes. To confuse matters, a kilobyte using the abbreviation KB may mean 1024 bytes.',1,'2017-05-12 02:35:16.120871','2017-05-12 02:35:16.120877');
INSERT INTO "quiz_question" VALUES(8,'What type of data structure is a queue?','data-structures',1,'','First In First Out. Picture a queue of people -- the first person (data item) in the queue is the first to leave the queue at the front. Additional people (data items) join at the back of the queue.',1,'2017-05-12 02:35:16.168108','2017-05-12 02:35:16.168128');
INSERT INTO "quiz_question" VALUES(9,'A Microsoft Exchange server is used for what?','server-software',1,'','Exchange servers are used for managing e-mail. They also manage calendars and contacts.',1,'2017-05-12 02:35:16.218548','2017-05-12 02:35:16.218554');
INSERT INTO "quiz_question" VALUES(10,'Which method can quickly and directly upload a file to a web server?','network',1,'','FTP stands for File Transfer Protocol, and can directly upload files to a web server.',1,'2017-05-12 02:35:16.271197','2017-05-12 02:35:16.271204');
INSERT INTO "quiz_question" VALUES(11,'What does a hard disk defragmenter do?','os',1,'','Data on the disk that has been split up is moved together, meaning there is less movement needed by the hard disk head to read the data.',1,'2017-05-12 02:35:16.317000','2017-05-12 02:35:16.317005');
INSERT INTO "quiz_question" VALUES(12,'What is the Windows page file otherwise known as?','windows',1,'','Virtual memory is space on the hard disk that is used when the physical memory (RAM) is all in use.',1,'2017-05-12 02:35:16.346202','2017-05-12 02:35:16.346208');
INSERT INTO "quiz_question" VALUES(13,'Which part of a laser printer heats and melts toner to the paper?','hardware',1,'','The fuser unit gets hot in order to fuse the powdered toner (that is earlier transfered to the paper) to the page so it does not smear.',1,'2017-05-12 02:35:16.373215','2017-05-12 02:35:16.373221');
INSERT INTO "quiz_question" VALUES(14,'Which of the following can be used to administer user accounts on a Microsoft Server 2003 network?','server-software',1,'','Active directory can be used for a large number of tasks, including administering computer and user accounts on a domain (or multiple domains).',1,'2017-05-12 02:35:16.406878','2017-05-12 02:35:16.406884');
INSERT INTO "quiz_question" VALUES(15,'What was the original purpose of a screen-saver?','hardware',1,'','On older monitors static images would be burned into the screen causing permanent damage. Screensavers were designed to keep a moving image on the screen that would not burn in.',1,'2017-05-12 02:35:16.435176','2017-05-12 02:35:16.435181');
INSERT INTO "quiz_question" VALUES(16,'A laptop generally has which type of screen?','hardware',1,'','Laptops usually have LCD screens. LCD stands for Liquid Crystal Display.',1,'2017-05-12 02:35:16.463544','2017-05-12 02:35:16.463550');
INSERT INTO "quiz_question" VALUES(17,'If a DVD ROM drive equipped computer will not play DVD''s, what might you try?','hardware',1,'','Codecs allow DVD''s to play on a computer - they are not always installed with the operating system for legal reasons, and must then be installed afterwards.',1,'2017-05-12 02:35:16.494820','2017-05-12 02:35:16.494826');
INSERT INTO "quiz_question" VALUES(18,'Which of these is an older connection used for printers?','hardware',1,'','Parallel cables have wide connectors and were used to connect printers and scanners. It is more common to use a USB connection now.',1,'2017-05-12 02:35:16.527187','2017-05-12 02:35:16.527193');
INSERT INTO "quiz_question" VALUES(19,'What might you use to connect and view the desktop of another Windows computer?','windows',1,'','RDP stands for Remote Desktop Protocol, which allows remote connections to networked PC''s and devices.',1,'2017-05-12 02:35:16.553331','2017-05-12 02:35:16.553338');
INSERT INTO "quiz_question" VALUES(20,'What does RDP stand for?','windows',1,'','RDP stands for Remote Desktop Protocol, which allows remote connections to networked PC''s and devices.',1,'2017-05-12 02:35:16.587275','2017-05-12 02:35:16.587282');
INSERT INTO "quiz_question" VALUES(21,'What does HTTP stand for?','network',1,'','Hyper Text Transfer Protocol is a data communication protocol used by the internet.',1,'2017-05-12 02:35:16.612816','2017-05-12 02:35:16.612823');
INSERT INTO "quiz_question" VALUES(22,'What does HTML stand for?','network',1,'','Hyper Text Markup Language is a programming language used to code webpages, and is understood by web browsers such as Internet Explorer.',1,'2017-05-12 02:35:16.644955','2017-05-12 02:35:16.644962');
INSERT INTO "quiz_question" VALUES(23,'What does USB stand for?','hardware',1,'','usb (Universal Serial Bus) can be used to connect all types of hardware to a PC. The technology is contantly being updated becoming faster with each release.',1,'2017-05-12 02:35:16.670479','2017-05-12 02:35:16.670496');
INSERT INTO "quiz_question" VALUES(24,'What program would usually be used in Windows to open a file with the extension: .txt','windows',1,'','Notepad is a basic text editor in Windows, and creates text only files (no colours, fonts etc) with the txt extension.',1,'2017-05-12 02:35:16.700228','2017-05-12 02:35:16.700236');
INSERT INTO "quiz_question" VALUES(25,'What does IP stand for?','network',1,'','Internet Protocol is a protocol used by the internet for sending data packets.',1,'2017-05-12 02:35:16.739213','2017-05-12 02:35:16.739221');
INSERT INTO "quiz_question" VALUES(26,'How many kilobytes are in a megabyte?','os',1,'','A megabyte (MB) is 1000 kilobytes (kB). A mebibyte (MiB) on the other hand is 1024 Kibibytes (KiB).',1,'2017-05-12 02:35:16.768990','2017-05-12 02:35:16.769000');
INSERT INTO "quiz_question" VALUES(27,'What is the size of a single sided, single layered DVD?','hardware',1,'','The standard size of a DVD disc is 4.7gb.',1,'2017-05-12 02:35:16.799519','2017-05-12 02:35:16.799527');
INSERT INTO "quiz_question" VALUES(28,'What does POP stand for in POP3?','network',3,'','Post Office Protocol is used by a computer/device to download e-mails from a remote server.',1,'2017-05-12 02:35:16.821768','2017-05-12 02:35:16.821774');
INSERT INTO "quiz_question" VALUES(29,'What does SMTP stand for?','network',1,'','SMTP is used to send e-mails across the internet.',1,'2017-05-12 02:35:16.850122','2017-05-12 02:35:16.850128');
INSERT INTO "quiz_question" VALUES(30,'What is OpenGL?','tools',1,'','OpenGL (Open Graphics Library) is a cross platform API for creating graphics.',1,'2017-05-12 02:35:16.888322','2017-05-12 02:35:16.888333');
INSERT INTO "quiz_question" VALUES(31,'How might related data be efficiently stored on a hard disk drive for faster access?','hardware',1,'','Parts of a single file that are spread out over the hard disk can be arranged so they are stored in order. Subsequent access is a lot faster.',1,'2017-05-12 02:35:16.916755','2017-05-12 02:35:16.916761');
INSERT INTO "quiz_question" VALUES(32,'What is the MBR on a PC hard disk?','hardware',1,'','The Master Boot Record is used for storing partition information and/or startup information for the operating system.',1,'2017-05-12 02:35:16.946988','2017-05-12 02:35:16.946993');
INSERT INTO "quiz_question" VALUES(33,'How might an unrecoverable BIOS password be reset?','hardware',1,'','Removing the battery for a short while will normally reset the BIOS password. You can also reset the BIOS password using jumpers on the motherboard.',1,'2017-05-12 02:35:16.984000','2017-05-12 02:35:16.984008');
INSERT INTO "quiz_question" VALUES(34,'If a laptop with an encrypted hard disk (but no available password) was found, how could this be circumvented to be used again?','security',1,'','The only way to use an encrypted hard disk without the password, is to erase the contents. Data cannot be recovered.',1,'2017-05-12 02:35:17.012982','2017-05-12 02:35:17.012988');
INSERT INTO "quiz_question" VALUES(35,'Which of the following is NOT a programming language?','programming',1,'','WYSIWYG stands for ''What You See Is What You Get'' - often webpages are build using WYSIWYG - it simply means when developing, you see the product as it will be seen by the user, rather than looking at programming code.',1,'2017-05-12 02:35:17.045284','2017-05-12 02:35:17.045290');
INSERT INTO "quiz_question" VALUES(36,'In a laser printer, the paper is not being fed in from the paper tray. What would you most likely need to replace?','hardware',1,'','Although potentially any of the above could prevent paper being fed if faulty, the most common is the pickup rollers, which wear down after a lot of use and become to smooth to pickup the paper.',1,'2017-05-12 02:35:17.073160','2017-05-12 02:35:17.073166');
INSERT INTO "quiz_question" VALUES(37,'What is the boot sector?','os',1,'','The boot sector is normally used to start the Operating System (OS). Information from it is moved into RAM to be used.',1,'2017-05-12 02:35:17.108664','2017-05-12 02:35:17.108672');
INSERT INTO "quiz_question" VALUES(38,'Which of the following is usually the fastest?','hardware',1,'','The CPU (Central Processing Unit, or Processor) is normally the fastest part of a computer and does most (or all) or the calculations the computer must compute.',1,'2017-05-12 02:35:17.137033','2017-05-12 02:35:17.137041');
INSERT INTO "quiz_question" VALUES(39,'What might you do to ensure a network printer is accessible to users at all times?','network',1,'','Reserving an IP address using DHCP means every time the printer is switched on, it will pick up the same IP address.',1,'2017-05-12 02:35:17.180611','2017-05-12 02:35:17.180619');
INSERT INTO "quiz_question" VALUES(40,'How is data stored on a standard hard disk drive?','hardware',1,'','Magnetic charge is used to set each bit on or off (1 or 0). This is the data stored in its most basic form, and ''on or off'' is the only form of data a computer can actually understand, as it is, in essence, and electronic device.',1,'2017-05-12 02:35:17.210945','2017-05-12 02:35:17.210972');
INSERT INTO "quiz_question" VALUES(41,'A user cannot run installation programs on their networked computer. How could the administrator change this?','os',1,'','Users can have different access permissions set up for many different files and settings, at varying levels of control.',1,'2017-05-12 02:35:17.241792','2017-05-12 02:35:17.241814');
INSERT INTO "quiz_question" VALUES(42,'What is low-level programming?','programming',1,'','A computer can not (at it''s basic level) work with numbers or characters etc, only ON or OFF values (represented by 1''s and 0''s in binary language). Binary is a low level programming language as it is close to what the computer can understand.',1,'2017-05-12 02:35:17.266521','2017-05-12 02:35:17.266526');
INSERT INTO "quiz_question" VALUES(43,'What is an OU used for in Active Directory?','server-software',1,'','For example, OU''s (Organisational Units) for a business domain might include ''Sales Team'', ''Clerical Staff'' etc and each OU''s objects could be given access to different files on the network.',1,'2017-05-12 02:35:17.308199','2017-05-12 02:35:17.308206');
INSERT INTO "quiz_question" VALUES(44,'How is a computer account added to a domain?','server-software',1,'','The computer must be manually added onto the domain, using the operating system''s build in tool.',1,'2017-05-12 02:35:17.335812','2017-05-12 02:35:17.335824');
INSERT INTO "quiz_question" VALUES(45,'What is a dead pixel?','hardware',1,'','The dead pixel may be off (black) or may be the wrong colour. This is quite common on LCD screens.',1,'2017-05-12 02:35:17.373647','2017-05-12 02:35:17.373653');
INSERT INTO "quiz_question" VALUES(46,'What is the Recovery Console?','windows',1,'','It can be used to fix problems with Windows that cannot be sorted when the operating system is in use (such ask disk checking and repair).',1,'2017-05-12 02:35:17.406612','2017-05-12 02:35:17.406619');
INSERT INTO "quiz_question" VALUES(47,'What is the usual way to access Windows XP Recovery Console?','windows',1,'','Booting from the Windows CD will allow access to the recovery console.',1,'2017-05-12 02:35:17.433363','2017-05-12 02:35:17.433382');
INSERT INTO "quiz_question" VALUES(48,'Why was the QWERTY keyboard designed with its layout as it is?','hardware',1,'','The layout of keys was designed to stop the long key arms of letter pairs (ch, sh etc) becoming stuck togther when pressed in quick succession, in order that faster typists had fewer problems. It is NOT, contrary to popular belief, to slow down the typist.',1,'2017-05-12 02:35:17.461025','2017-05-12 02:35:17.461036');
INSERT INTO "quiz_question" VALUES(49,'Which would help boost a wireless network signal?','network',1,'','A wireless repeater will ''refresh'' the wireless signal by sending it out again, boosting the area covered.',1,'2017-05-12 02:35:17.493076','2017-05-12 02:35:17.493084');
INSERT INTO "quiz_question" VALUES(50,'Which of the following would BEST help secure a home wireless network from malicious ''piggybacking''?','security',1,'','As long as the network is secure with a password, it is unlikely there will be any intrusions (although this is not guaranteed).',1,'2017-05-12 02:35:17.523083','2017-05-12 02:35:17.523094');
INSERT INTO "quiz_question" VALUES(51,'What is a VLAN?','network',1,'','A large network can be split into VLANs (for example by departments in an organisation). Each VLAN is treated as a network itself. This helps minimise data flowing round the main network infrastructure.',1,'2017-05-12 02:35:17.549498','2017-05-12 02:35:17.549503');
INSERT INTO "quiz_question" VALUES(52,'What might you use RDP for?','windows',1,'','RDP (Remote Desktop Protocol) allows connection to remote computers and devices on the network.',1,'2017-05-12 02:35:17.576898','2017-05-12 02:35:17.576903');
INSERT INTO "quiz_question" VALUES(53,'What is a shell script written for?','linux',1,'','Scripts are processed by the command line interpreter.',1,'2017-05-12 02:35:17.614252','2017-05-12 02:35:17.614258');
INSERT INTO "quiz_question" VALUES(54,'Which of the following is NOT true of a proxy?','network',1,'','A proxy does NOT allow more data to pass through more quickly - it is used to restrict data received/transmitted from a computer/device.',1,'2017-05-12 02:35:17.643207','2017-05-12 02:35:17.643214');
INSERT INTO "quiz_question" VALUES(55,'What is firewire used for?','hardware',1,'','Firewire (IEEE1394) is a technology often used for transferring data to/from multimedia devices such as digital camcorders.',1,'2017-05-12 02:35:17.668143','2017-05-12 02:35:17.668148');
INSERT INTO "quiz_question" VALUES(56,'What is MSConfig used for?','os',1,'','MSConfig is a good tool for diagnosing Windows startup problems as it allows the turning off of certain features.',1,'2017-05-12 02:35:17.697496','2017-05-12 02:35:17.697505');
INSERT INTO "quiz_question" VALUES(57,'What is event viewer used for?','tools',1,'','Event viewer is a detailed logging system for Windows operating systems. It contains information for many actions performed by the operating system itself and software installed on it. It provides information of any error messages along with the times they happened.',1,'2017-05-12 02:35:17.727645','2017-05-12 02:35:17.727652');
INSERT INTO "quiz_question" VALUES(58,'What might you try FIRST if Windows reports corrupt files?','windows',1,'','Running the chkdsk /r (check disk) command from the recovery console will normally repair any corrupt file problems in the operating system.',1,'2017-05-12 02:35:17.763270','2017-05-12 02:35:17.763276');
INSERT INTO "quiz_question" VALUES(59,'What is FTP used for?','network',1,'','FTP (File Transfer Protocol) allows direct transfer of files to a remote server (often used for quickly uploading webpages to a web server).',1,'2017-05-12 02:35:17.796470','2017-05-12 02:35:17.796486');
INSERT INTO "quiz_question" VALUES(60,'In order to use an extended desktop over two monitors, what is recommended for a PC?','hardware',1,'','The dual screen card will allow two monitors to be connected and the display spanned over two monitors.',1,'2017-05-12 02:35:17.822998','2017-05-12 02:35:17.823005');
INSERT INTO "quiz_question" VALUES(61,'If you wish to clone your computer''s display onto a projector, what could you use (on most computers/monitors/projectors)?','hardware',1,'','A VGA splitter will split the signal from the graphics adapter on the computer so it can be clones onto the projector.',1,'2017-05-12 02:35:17.852780','2017-05-12 02:35:17.852786');
INSERT INTO "quiz_question" VALUES(62,'What is multitasking in an operating system?','os',1,'','A computer will allow multiple tasks to seemingly be running at the same time (in fact, different tasks are switched between very quickly, giving the impression they are running at the same time). This is called multitasking. See also Multithreading, which is another related subject.',1,'2017-05-12 02:35:17.883750','2017-05-12 02:35:17.883756');
INSERT INTO "quiz_question" VALUES(63,'What is web caching?','network',1,'','If a webpage is cached, it does not need to be fully downloaded from the server the next time it is viewed, as some or all of the page will be in cached.',1,'2017-05-12 02:35:17.918430','2017-05-12 02:35:17.918436');
INSERT INTO "quiz_question" VALUES(64,'What process can be restarted if Windows has crashed, in order for the start menu and icons to reappear?','windows',1,'','If explorer.exe crashes or is stopped, the start menu and icons will not be visible. Starting the process back up will resolve this.',1,'2017-05-12 02:35:17.942260','2017-05-12 02:35:17.942265');
INSERT INTO "quiz_question" VALUES(65,'How would you allow specific data to pass through Windows Firewall?','security',1,'','Exceptions provide just that - an exception to the rule. Everything is blocked by a firewall unless the firewall knows to let it through using an exception.',1,'2017-05-12 02:35:17.973493','2017-05-12 02:35:17.973501');
INSERT INTO "quiz_question" VALUES(66,'What is indexing useful for?','os',1,'','For example, an operating system may make and index of all files on the hard disk. When a search is performed for a filename, the operating system simply searches the index rather than searching the entire hard disk for the file name.',1,'2017-05-12 02:35:17.999313','2017-05-12 02:35:17.999337');
INSERT INTO "quiz_question" VALUES(67,'What is an SSID?','network',1,'','The name by which the wireless name can be addess onto a networked device is called the SSID (Service Set Identification).',1,'2017-05-12 02:35:18.025544','2017-05-12 02:35:18.025553');
INSERT INTO "quiz_question" VALUES(68,'Why might you roll back a driver?','hardware',1,'','Problematic drivers can be rolled back in modern versions of Windows. If a driver causes problems with the operating system or hardware, it can be rolled back to a previous version.',1,'2017-05-12 02:35:18.063220','2017-05-12 02:35:18.063228');
INSERT INTO "quiz_question" VALUES(69,'What is a system restore point used for in Windows?','windows',1,'','If Windows suddenly will not boot, as long as restore points are turned on, the system can be restored to a working state.',1,'2017-05-12 02:35:18.088143','2017-05-12 02:35:18.088153');
INSERT INTO "quiz_question" VALUES(70,'What is FAT32?','os',1,'','FAT stands for File Allocation Table. The 32 means 32 bit.',1,'2017-05-12 02:35:18.114995','2017-05-12 02:35:18.115001');
INSERT INTO "quiz_question" VALUES(71,'When would safemode be LEAST useful?','windows',1,'','Safemode allows certain features to be used without booting into Windows. It is used for repairing/diagnosing problems with Windows and comes on the Windows disk as a bootable tool.',1,'2017-05-12 02:35:18.140487','2017-05-12 02:35:18.140492');
INSERT INTO "quiz_question" VALUES(72,'From where could you map a network drive in Windows?','windows',1,'','Right clicking ''My Computer'' or using the menu within ''My Computer'' allows mapping of a network drive. This can also be done at command prompt using the ''net use'' command.',1,'2017-05-12 02:35:18.180650','2017-05-12 02:35:18.180655');
INSERT INTO "quiz_question" VALUES(73,'Why might you map a network drive?','windows',1,'','Mapping drives allows any shared folder to be used like a separate drive. The shared folder is usually on a remote computer or server.',1,'2017-05-12 02:35:18.208590','2017-05-12 02:35:18.208596');
INSERT INTO "quiz_question" VALUES(74,'What does the registry key HKCR contain in Windows?','windows',3,'','Allows certain file types to be associated with applications (ie Word documents are associate with Microsoft Office Word).',1,'2017-05-12 02:35:18.245286','2017-05-12 02:35:18.245299');
INSERT INTO "quiz_question" VALUES(75,'What is a batch file?','os',1,'','The file can be used to automate the running of command line commands eg for copying files, mapping drives etc.',1,'2017-05-12 02:35:18.274413','2017-05-12 02:35:18.274419');
INSERT INTO "quiz_question" VALUES(76,'What is a collision domain?','network',1,'','Collision on a data network are very common and reducing them is one of the many goals of the network manager.',1,'2017-05-12 02:35:18.304154','2017-05-12 02:35:18.304159');
INSERT INTO "quiz_question" VALUES(77,'Which is NOT a difference between XP and 98','os',1,'','The file extension ''.exe'' has remained consistant across all versions of Windows.',1,'2017-05-12 02:35:18.333540','2017-05-12 02:35:18.333549');
INSERT INTO "quiz_question" VALUES(78,'What was the first Microsoft Operating System?','os',1,'','DOS, or ''Disk Operating System''',1,'2017-05-12 02:35:18.363383','2017-05-12 02:35:18.363388');
INSERT INTO "quiz_question" VALUES(79,'Which operating system is NOT based on DOS?','os',1,'','Windows XP is not based on DOS. Windows Me ''pretended'' not to be based on DOS, but it was.',1,'2017-05-12 02:35:18.392500','2017-05-12 02:35:18.392506');
INSERT INTO "quiz_question" VALUES(80,'Which of the following companies have NEVER produced personal computers?','history',1,'','They build hardware and firmware, but never full personal computers. All the other companies have produced PC''s.',1,'2017-05-12 02:35:18.420691','2017-05-12 02:35:18.420696');
INSERT INTO "quiz_question" VALUES(81,'Which of the following is NOT an operating system?','os',1,'','VMWare is used for desktop virtualization.',1,'2017-05-12 02:35:18.444950','2017-05-12 02:35:18.444956');
INSERT INTO "quiz_question" VALUES(82,'What might be applied to software to fix a specific issue?','os',1,'','A patch will repair problems with software. After a piece of software is released, there are often problems which are not found during testing. Patches are then released by the developer to fix these problems.',1,'2017-05-12 02:35:18.481430','2017-05-12 02:35:18.481437');
INSERT INTO "quiz_question" VALUES(83,'Which best describes a Trojan horse?','security',1,'','The name is based on the military move by the Greeks in the Trojan war using a large wooden horse (Or rabbit if you have seen Monty Python and the Holy Grail!) to hide soldiers.',1,'2017-05-12 02:35:18.508179','2017-05-12 02:35:18.508185');
INSERT INTO "quiz_question" VALUES(84,'Which of the following statements is TRUE about a worm and a virus?','security',1,'','A worm can e-mail itself using contacts stored on a computer, without the user even doing anything.',1,'2017-05-12 02:35:18.535764','2017-05-12 02:35:18.535771');
INSERT INTO "quiz_question" VALUES(85,'What does DOS stand for?','history',1,'','DOS was Microsoft''s first operating system, and was used as a basis for a number of it''s future operating systems.',1,'2017-05-12 02:35:18.562491','2017-05-12 02:35:18.562509');
INSERT INTO "quiz_question" VALUES(86,'Which command would you use in Windows 8 to view the ARP cache?','windows',1,'','ARP stands for Address Resolution Protocol. It is a networking protocol.',1,'2017-05-12 02:35:18.588083','2017-05-12 02:35:18.588092');
INSERT INTO "quiz_question" VALUES(87,'Using the command line, which command might you use to change the file association of a partiular file type in Windows 8?','windows',1,'','For example, you could set xml files to be associated as text files.',1,'2017-05-12 02:35:18.629148','2017-05-12 02:35:18.629156');
INSERT INTO "quiz_question" VALUES(88,'What would appear if you typed ''cal'' at a Linux Bash command prompt?','linux',1,'','A calendar is displayed in text form, in the command prompt.',1,'2017-05-12 02:35:18.661148','2017-05-12 02:35:18.661155');
INSERT INTO "quiz_question" VALUES(89,'What is the command ''cp'' in a Linux Bash command prompt used for?','linux',1,'','The cp command can be used to copy files.',1,'2017-05-12 02:35:18.694316','2017-05-12 02:35:18.694324');
INSERT INTO "quiz_question" VALUES(90,'What are Active X controls?','tools',1,'','An Active X control is run within a web browser, and is used for certain features on some websites or applications.',1,'2017-05-12 02:35:18.726428','2017-05-12 02:35:18.726435');
INSERT INTO "quiz_question" VALUES(91,'What are java applets?','tools',1,'','A Java applet is run from a web browser and is not a standalone application. It might be a clock display on a web page for example.',1,'2017-05-12 02:35:18.753792','2017-05-12 02:35:18.753800');
INSERT INTO "quiz_question" VALUES(92,'What can Tweak UI be used for?','os',1,'','Tweak UI is a free tool provided by Microsoft which provides Windows users more control over visual aspects of their operating system.',1,'2017-05-12 02:35:18.785513','2017-05-12 02:35:18.785520');
INSERT INTO "quiz_question" VALUES(93,'What device in a PC stores a MAC address?','network',1,'','The Network Interface Card (NIC) holds the MAC address (A.K.A. the Hardware Address).',1,'2017-05-12 02:35:18.818537','2017-05-12 02:35:18.818545');
INSERT INTO "quiz_question" VALUES(94,'How can a MAC address be changed in a PC?','network',1,'','Changing the network interface is one way to change the MAC/hardware address on a computer. There is also software available that can make this change without changing hardware.',1,'2017-05-12 02:35:18.845225','2017-05-12 02:35:18.845249');
INSERT INTO "quiz_question" VALUES(95,'What does mounting a disk drive achieve?','os',1,'','Mounting a drive allows the file system access to it.',1,'2017-05-12 02:35:18.870973','2017-05-12 02:35:18.870979');
INSERT INTO "quiz_question" VALUES(96,'What is a partition?','hardware',1,'','A partition will appear to the user as a separate disk drive. It may use a different file system and/or contain a separate operating system.',1,'2017-05-12 02:35:18.898921','2017-05-12 02:35:18.898927');
INSERT INTO "quiz_question" VALUES(97,'What does a server serve?','server-software',1,'','Technically speaking, a server serves clients. These may be computers, mobile devices, printers, users etc.',1,'2017-05-12 02:35:18.929817','2017-05-12 02:35:18.929823');
INSERT INTO "quiz_question" VALUES(98,'What special piece of software allows hardware to communicate with software?','hardware',1,'','A driver is normally provided by the manufacturer of the software and allows specified operating systems to interact with the hardware. Modern operating systems do come with a limited set of basic drivers so some devices will work without installing the drivers from the manufacturer.',1,'2017-05-12 02:35:18.962285','2017-05-12 02:35:18.962291');
INSERT INTO "quiz_question" VALUES(99,'What does PCI stand for?','hardware',1,'','The PCI ports on a PC can be used to connect all kinds of devices including network cards, TV cards, wireless network cards etc.',1,'2017-05-12 02:35:18.989043','2017-05-12 02:35:18.989049');
INSERT INTO "quiz_question" VALUES(100,'What is PCIe?','hardware',1,'','PCIe - Peripheral Component Interconnect - is a faster more modern version of the standard PCI connection.',1,'2017-05-12 02:35:19.018808','2017-05-12 02:35:19.018815');
INSERT INTO "quiz_question" VALUES(101,'What might you use PCMCIA for?','hardware',1,'','PCMCIA, or PC Card, is usually used for network adapters, but has other uses.',1,'2017-05-12 02:35:19.043575','2017-05-12 02:35:19.043580');
INSERT INTO "quiz_question" VALUES(102,'What is a multiboot?','os',1,'','Some users have the need to boot from multiple operating systems (eg Windows 7 and Ubuntu 11).',1,'2017-05-12 02:35:19.079658','2017-05-12 02:35:19.079665');
INSERT INTO "quiz_question" VALUES(103,'What is a disk sector on a hard disk?','hardware',1,'','A disk sector is a physical storage area on a hard disk drive.',1,'2017-05-12 02:35:19.113619','2017-05-12 02:35:19.113625');
INSERT INTO "quiz_question" VALUES(104,'How is data stored on a hard disk drive?','hardware',1,'','Data is stored magnetically on the disk platters, and by the read/write head.',1,'2017-05-12 02:35:19.146895','2017-05-12 02:35:19.146901');
INSERT INTO "quiz_question" VALUES(105,'What is a BSOD?','history',1,'','BSOD stands for Blue Screen of Death, and results in a computer being restarted after a hardware or software error that the operating system cannot recover from.',1,'2017-05-12 02:35:19.176162','2017-05-12 02:35:19.176168');
INSERT INTO "quiz_question" VALUES(106,'Which is most likely to cause a Blue Screen of Death?','os',1,'','Faulty hardware is a common cause of the BSOD, along with faulty drivers.',1,'2017-05-12 02:35:19.203421','2017-05-12 02:35:19.203426');
INSERT INTO "quiz_question" VALUES(107,'Which of the following is most likely to require its own fan?','hardware',1,'','The processor will always have its own cooling system as it becomes very hot during computer use.',1,'2017-05-12 02:35:19.231933','2017-05-12 02:35:19.231940');
INSERT INTO "quiz_question" VALUES(108,'What key should be pressed to access safe mode at startup in Windows XP?','windows',1,'','F8 is the shortcut key that allows various boot options such as safe mode, safe mode with networking, and command prompt.',1,'2017-05-12 02:35:19.260049','2017-05-12 02:35:19.260055');
INSERT INTO "quiz_question" VALUES(109,'Which company produces processors for personal computers?','hardware',1,'','Intel produce processors such as the Celeron, Core 3,5,7 and Pentium.',1,'2017-05-12 02:35:19.290521','2017-05-12 02:35:19.290529');
INSERT INTO "quiz_question" VALUES(110,'What is SQL used for?','programming',1,'','SQL (Structured Query Language) is used for querying databases to fetch results.',1,'2017-05-12 02:35:19.317218','2017-05-12 02:35:19.317225');
INSERT INTO "quiz_question" VALUES(111,'What is ASCII?','os',1,'','ASCII - American Standard Code for Information Interchange',1,'2017-05-12 02:35:19.345935','2017-05-12 02:35:19.345953');
INSERT INTO "quiz_question" VALUES(112,'What is Citrix Shadow used for?','virtualization',1,'','When Shadowing, you can see anything that the user can see within their Citrix session, and can use your keyboard and mouse to interact with their session.',1,'2017-05-12 02:35:19.380418','2017-05-12 02:35:19.380425');
INSERT INTO "quiz_question" VALUES(113,'What is a Server Farm?','virtualization',1,'','The workload in a server farm is distributed amongst the servers.',1,'2017-05-12 02:35:19.413592','2017-05-12 02:35:19.413600');
INSERT INTO "quiz_question" VALUES(114,'Which company produces a product called XenApp?','virtualization',1,'','Citrix XenApp is a product used for application virtualization, allowing users to connect to corporate applications from different devices and platforms.',1,'2017-05-12 02:35:19.442111','2017-05-12 02:35:19.442118');
INSERT INTO "quiz_question" VALUES(115,'What is Citrix XenDesktop''s purpose?','virtualization',1,'','Citrix XenDesktop is a desktop virtualization product',1,'2017-05-12 02:35:19.466929','2017-05-12 02:35:19.466935');
INSERT INTO "quiz_question" VALUES(116,'Which of the following is NOT USUALLY a benefit of desktop virtualization?','virtualization',1,'','virtualization is network heavy, so implementing it on a network infrastructure that is already in place is likely to cause an overall increase in network traffic.',1,'2017-05-12 02:35:19.495078','2017-05-12 02:35:19.495084');
INSERT INTO "quiz_question" VALUES(117,'What is 10baseT related to?','network',1,'','10 means 10Mbps bandwidth. The T stands for Twisted-pair, as ethernet networking uses twisted pairs of cables.',1,'2017-05-12 02:35:19.537543','2017-05-12 02:35:19.537551');
INSERT INTO "quiz_question" VALUES(118,'What is DHCP used for?','network',1,'','DHCP (Dynamic Host Configuration Protocol) is used to automatically assign IP addresses to devices on the network.',1,'2017-05-12 02:35:19.571119','2017-05-12 02:35:19.571127');
INSERT INTO "quiz_question" VALUES(119,'What is an ISO file?','os',1,'','An ISO is created from an optical disk, and can be used to recreate exact copies of the original disc.',1,'2017-05-12 02:35:19.604432','2017-05-12 02:35:19.604439');
INSERT INTO "quiz_question" VALUES(120,'What is Token Ring?','network',1,'','Token ring is a network protocol whereby data is transmitted when the token is held. The token is passed around in a ring between devices/nodes.',1,'2017-05-12 02:35:19.636955','2017-05-12 02:35:19.636962');
INSERT INTO "quiz_question" VALUES(121,'What is NOT true of hubs compared to switches?','network',1,'','The above statement is NOT true as a switch can never act as a server.',1,'2017-05-12 02:35:19.667214','2017-05-12 02:35:19.667222');
INSERT INTO "quiz_question" VALUES(122,'What is Ubuntu?','os',1,'','Ubuntu is commonly used as an introduction to Linux for first time users, as it is simple to use and very user friendly.',1,'2017-05-12 02:35:19.699392','2017-05-12 02:35:19.699399');
INSERT INTO "quiz_question" VALUES(123,'What is Fedora?','os',1,'','Fedora is a very popular Linux based operating system along with software accompanying it.',1,'2017-05-12 02:35:19.730091','2017-05-12 02:35:19.730098');
INSERT INTO "quiz_question" VALUES(124,'What is the job of a network repeater?','network',1,'','A network transmission will deteriorate over distance and so a repeated amplifies the signal before sending it on.',1,'2017-05-12 02:35:19.756259','2017-05-12 02:35:19.756267');
INSERT INTO "quiz_question" VALUES(125,'What is a routing table used for?','network',1,'','The routing table builds up a list of hosts and the route that is needed to reach the hosts.',1,'2017-05-12 02:35:19.780740','2017-05-12 02:35:19.780754');
INSERT INTO "quiz_question" VALUES(126,'Which of the following has a degaussing feature?','hardware',1,'','A CRT monitor is affected by magnetic fields - degaussing is used to correct any problems caused my magnetic interference.',1,'2017-05-12 02:35:19.815551','2017-05-12 02:35:19.815570');
INSERT INTO "quiz_question" VALUES(127,'What is bit short for?','os',1,'','The word ''bit'' is short for ''binary digit''. A bit is a single value of on/off (or 1/0).',1,'2017-05-12 02:35:19.848841','2017-05-12 02:35:19.848864');
INSERT INTO "quiz_question" VALUES(128,'When referring to window layout, what does the D stand for in MDI?','os',1,'','An MDI is a Multiple Document Interface. For example in word processing software, if all document windows were opened within a parent window, that would be an MDI.',1,'2017-05-12 02:35:19.874488','2017-05-12 02:35:19.874511');
INSERT INTO "quiz_question" VALUES(129,'What do the D and S stand for in DIMM and SIMM?','hardware',1,'','Dual Inline Memory Module, Single Inline Memory Module.',1,'2017-05-12 02:35:19.900726','2017-05-12 02:35:19.900736');
INSERT INTO "quiz_question" VALUES(130,'What is Windows 8''s server counterpart operating system named?','os',1,'','It was codenamed Windows Server 8, but its release name is Windows Server 2012, in keeping with the naming convention used since Windows Server 2003. Before that was Windows 2000 Server.',1,'2017-05-12 02:35:19.927480','2017-05-12 02:35:19.927487');
INSERT INTO "quiz_question" VALUES(131,'What is the Windows 8 user interface based on?','windows',1,'','The Windows 8 user interface will be based on Microsoft''s Metro design language, and will be based more on typography than imagery.',1,'2017-05-12 02:35:19.966362','2017-05-12 02:35:19.966368');
INSERT INTO "quiz_question" VALUES(132,'What is the purpose of a subnet mask?','network',1,'','A subnet mast looks something like this: 255.255.255.0',1,'2017-05-12 02:35:19.999723','2017-05-12 02:35:19.999731');
INSERT INTO "quiz_question" VALUES(133,'Which of the following subnet masks belongs to a class C network?','network',3,'','Class A: 255.0.0.0, Class B: 255.255.0.0, Class C: 255.255.255.0.',1,'2017-05-12 02:35:20.033878','2017-05-12 02:35:20.033888');
INSERT INTO "quiz_question" VALUES(134,'What does ''IMAP'' stand for?','network',1,'','IMAP is a protocol like POP (Post Office Protocol) for writing and receiving emails.',1,'2017-05-12 02:35:20.064919','2017-05-12 02:35:20.064934');
INSERT INTO "quiz_question" VALUES(135,'Which Linux application could you use to adjust partitions on a hard disk?','os',1,'','GParted is used for partition management.',1,'2017-05-12 02:35:20.096102','2017-05-12 02:35:20.096118');
INSERT INTO "quiz_question" VALUES(136,'Which of the following is a popular anti malware program?','security',1,'','There is a free version of MalwareBytes. It is a very popular tool for malware removal.',1,'2017-05-12 02:35:20.129078','2017-05-12 02:35:20.129095');
INSERT INTO "quiz_question" VALUES(137,'What does ReadyBoost do in Windows Vista (and later)?','os',1,'','ReadyBoost allows a formatted USB drive to be used as RAM.',1,'2017-05-12 02:35:20.160120','2017-05-12 02:35:20.160158');
INSERT INTO "quiz_question" VALUES(138,'Which accessory, included in Windows 7, allows taking of a snapshot from a selected area of the screen?','os',1,'','The snipping tool is vey useful and is much less cumbersome that taking a full print screen.',1,'2017-05-12 02:35:20.189277','2017-05-12 02:35:20.189286');
INSERT INTO "quiz_question" VALUES(139,'Which accessory, included in Windows 7, displays a post-it style note onscreen that can be edited?','os',1,'','Sticky Notes can be edited, and are a useful alternative to real post it notes.',1,'2017-05-12 02:35:20.217959','2017-05-12 02:35:20.217965');
INSERT INTO "quiz_question" VALUES(140,'Which company is named after a US city?','history',1,'','The word Cisco is short for San Francisco.',1,'2017-05-12 02:35:20.249601','2017-05-12 02:35:20.249611');
INSERT INTO "quiz_question" VALUES(141,'What was the first product Apple sold?','history',1,'','The Apple Computer is now referred to as the Apple I. It was not sold with keyboard, casing etc.',1,'2017-05-12 02:35:20.280440','2017-05-12 02:35:20.280446');
INSERT INTO "quiz_question" VALUES(142,'When did Apple''s first computer go on sale?','history',1,'','It was simply called the Apple Computer. It is now referred to as the Apple I.',1,'2017-05-12 02:35:20.307975','2017-05-12 02:35:20.307981');
INSERT INTO "quiz_question" VALUES(143,'What is the original name of Apple Inc.?','history',1,'','Apple Computer was founded in 1976.',1,'2017-05-12 02:35:20.335476','2017-05-12 02:35:20.335482');
INSERT INTO "quiz_question" VALUES(144,'Which command can you use in Windows 7 to list running processes?','windows',1,'','Tasklist.exe will list all running processes. Use ''tasklist /s <hostname>'' to show the same information for a remote computer.',1,'2017-05-12 02:35:20.362084','2017-05-12 02:35:20.362099');
INSERT INTO "quiz_question" VALUES(145,'Which command can you use in Windows 7 to kill running processes?','windows',1,'','Taskkill.exe will end a specified running processes. Use ''tasklist'' to simply view the processes before using taskkill to kill them.',1,'2017-05-12 02:35:20.397408','2017-05-12 02:35:20.397415');
INSERT INTO "quiz_question" VALUES(146,'What does the command ''Netstat -a'' do in Windows?','os',1,'','''Netstat -a'' shows all the connections to your computer including yourself. You can use it to see if anyone else is connected to your computer too.',1,'2017-05-12 02:35:20.431514','2017-05-12 02:35:20.431521');
INSERT INTO "quiz_question" VALUES(147,'In Windows 8, what is the name of the tiled area that shows your apps?','os',1,'','It is possible to move from ''Start'' to the desktop by moving the mouse into the bottom left of the screen.',1,'2017-05-12 02:35:20.460778','2017-05-12 02:35:20.460793');
INSERT INTO "quiz_question" VALUES(148,'Which Microsoft application uses PST files?','tools',1,'','Microsoft Outlook stores a lot of information in a PST file, such as contacts, e-mails etc. It is known to cause problems in exchange server environments as the PST can be saved off the network, and therefore insecurely.',1,'2017-05-12 02:35:20.495496','2017-05-12 02:35:20.495502');
INSERT INTO "quiz_question" VALUES(149,'How many printable characters are included in ASCII?','programming',3,'','There are 95 printable characters in ASCII (Many are not printable, for example one character represents a ''beep'' sound).',1,'2017-05-12 02:35:20.521860','2017-05-12 02:35:20.521866');
INSERT INTO "quiz_question" VALUES(150,'What is nslookup used for?','network',3,'','NSlookup can be used for example to find a hostname for a given IP address.',1,'2017-05-12 02:35:20.557452','2017-05-12 02:35:20.557458');
INSERT INTO "quiz_question" VALUES(151,'What is disk striping related to?','hardware',3,'','Disk Striping separates data into several blocks spread over multiple partitions on multiple disk drives.',1,'2017-05-12 02:35:20.590372','2017-05-12 02:35:20.590378');
INSERT INTO "quiz_question" VALUES(152,'Which is NOT a layer of the ISO/OSI network model?','network',3,'','The layers are: physical, data link, network, transport, session, presentation, application.',1,'2017-05-12 02:35:20.616789','2017-05-12 02:35:20.616796');
INSERT INTO "quiz_question" VALUES(153,'Which of the following is NOT a layer of the ISO/OSI network model?','network',3,'','The layers are: physical, data link, network, transport, session, presentation, application.',1,'2017-05-12 02:35:20.642730','2017-05-12 02:35:20.642736');
INSERT INTO "quiz_question" VALUES(154,'What is/was Colossus?','history',3,'','Colossus was used in the war to crack codes.',1,'2017-05-12 02:35:20.673010','2017-05-12 02:35:20.673017');
INSERT INTO "quiz_question" VALUES(155,'What would be used to connect a computer to a data point?','network',3,'','A straight through cable is used to connect a computer to a standard data point (which in turn would be patched to a switch).',1,'2017-05-12 02:35:20.711948','2017-05-12 02:35:20.711955');
INSERT INTO "quiz_question" VALUES(156,'What is default gateway?','network',3,'','For example, a gateway is used to connect to the internet.',1,'2017-05-12 02:35:20.738396','2017-05-12 02:35:20.738402');
INSERT INTO "quiz_question" VALUES(157,'How many individual wires are in a cat5e cable?','network',3,'','8 wires in total - white+orange, orange, white+green, blue, white+blue, green, white+brown, brown.',1,'2017-05-12 02:35:20.766452','2017-05-12 02:35:20.766459');
INSERT INTO "quiz_question" VALUES(158,'Why are wires in network cables twisted?','network',3,'','Twisted cables will act as a form of interference reduction from external sources.',1,'2017-05-12 02:35:20.793635','2017-05-12 02:35:20.793642');
INSERT INTO "quiz_question" VALUES(159,'What is a virtual disk?','os',3,'','A virtual disk is not a physical storage device, and has no physical presence (although of course a physical disk is needed to contain the virtual disk and its contents).',1,'2017-05-12 02:35:20.833084','2017-05-12 02:35:20.833091');
INSERT INTO "quiz_question" VALUES(160,'What is Windows Powershell?','windows',3,'','It allows a Windows users and administrators much more control than the built in command line tools in Windows.',1,'2017-05-12 02:35:20.868383','2017-05-12 02:35:20.868390');
INSERT INTO "quiz_question" VALUES(161,'What is the GNU?','tools',3,'','It stands for GNU''s Not Unix',1,'2017-05-12 02:35:20.902233','2017-05-12 02:35:20.902239');
INSERT INTO "quiz_question" VALUES(162,'What are Gnome and KDE?','os',3,'','Gnome and KDE are desktop environments used in various versions of Linux.',1,'2017-05-12 02:35:20.931537','2017-05-12 02:35:20.931545');
INSERT INTO "quiz_question" VALUES(163,'Who designed Colossus?','history',3,'','Colossus was used to crack military codes used in World War 2.',1,'2017-05-12 02:35:20.962260','2017-05-12 02:35:20.962266');
INSERT INTO "quiz_question" VALUES(164,'What does API stand for?','programming',3,'','An API provides an interface for developers to interract with another application, website, system etc. Eg an API for ebay would allow ebay applications developed by third parties, to integrate corectly with ebay.',1,'2017-05-12 02:35:20.991903','2017-05-12 02:35:20.991909');
INSERT INTO "quiz_question" VALUES(165,'What is non-volatile storage?','hardware',3,'','An example of non-volatile storage is a hard disk drive. Volatile storage, on the other hand (for example RAM), loses data when power is removed.',1,'2017-05-12 02:35:21.022718','2017-05-12 02:35:21.022725');
INSERT INTO "quiz_question" VALUES(166,'What type of Ethernet cable would you use to connect two devices of the same type?','network',3,'','For example to connect a switch to a switch or a computer to a computer, a crossover cable is needed.',1,'2017-05-12 02:35:21.049623','2017-05-12 02:35:21.049630');
INSERT INTO "quiz_question" VALUES(167,'What is iEEE 1394 better known as?','hardware',3,'','Firewire is a technology used for multimedia data transfer. It is simillar in many ways to USB.',1,'2017-05-12 02:35:21.076478','2017-05-12 02:35:21.076486');
INSERT INTO "quiz_question" VALUES(168,'Add the following in hexadecimal: Ah + Dh','programming',3,'','Hexadecimal is base 16, so numbers go from 0-F (F being equivalent to 15 in decimal).',1,'2017-05-12 02:35:21.107612','2017-05-12 02:35:21.107619');
INSERT INTO "quiz_question" VALUES(169,'What is a tree when discussing domains?','server-software',3,'','A tree is a collection of domains. The parent of a tree is a forest (which contains multiple domain trees).',1,'2017-05-12 02:35:21.137800','2017-05-12 02:35:21.137807');
INSERT INTO "quiz_question" VALUES(170,'What might the term ''non-buffered'' relate to?','hardware',3,'','Non-buffered is a feature of RAM (Random Access Memory) or physical memory.',1,'2017-05-12 02:35:21.159511','2017-05-12 02:35:21.159517');
INSERT INTO "quiz_question" VALUES(171,'What is a cluster?','os',3,'','Computers can work together on certains tasks. They work in a cluster.',1,'2017-05-12 02:35:21.186503','2017-05-12 02:35:21.186508');
INSERT INTO "quiz_question" VALUES(172,'What is WINS?','os',3,'','It is a name service for NetBIOS.',1,'2017-05-12 02:35:21.212258','2017-05-12 02:35:21.212264');
INSERT INTO "quiz_question" VALUES(173,'Javascript is best described how?','programming',3,'','Javascript runs on the computer, rather than on the server, and so is ''client side''.',1,'2017-05-12 02:35:21.239787','2017-05-12 02:35:21.239794');
INSERT INTO "quiz_question" VALUES(174,'How might you register a DLL file in Windows?','windows',3,'','Registering a DLL file makes it available to the operating system.',1,'2017-05-12 02:35:21.275724','2017-05-12 02:35:21.275730');
INSERT INTO "quiz_question" VALUES(175,'What does DLL stand for?','windows',3,'','A DLL file contains shared resources that can be used by various programs on a computer.',1,'2017-05-12 02:35:21.308008','2017-05-12 02:35:21.308015');
INSERT INTO "quiz_question" VALUES(176,'Which of the following applies to a DLL file?','os',3,'','The DLL file contains shared resources.',1,'2017-05-12 02:35:21.341405','2017-05-12 02:35:21.341411');
INSERT INTO "quiz_question" VALUES(177,'What does SQL stand for?','programming',3,'','SQL (Structured Query Language) is used for querying databases to fetch results.',1,'2017-05-12 02:35:21.375020','2017-05-12 02:35:21.375026');
INSERT INTO "quiz_question" VALUES(178,'What is a hard disk platter?','hardware',3,'','The platter is a physical disc on which data is written. There are usually several platters in a hard disk drive.',1,'2017-05-12 02:35:21.401203','2017-05-12 02:35:21.401209');
INSERT INTO "quiz_question" VALUES(179,'What is a jumper?','hardware',3,'','The jumper allows certain settings to be changed using a small device that joins pins together.',1,'2017-05-12 02:35:21.431662','2017-05-12 02:35:21.431669');
INSERT INTO "quiz_question" VALUES(180,'What does a hard drive spindle do?','hardware',3,'','Each platter (disc) inside a hard disk drive is turned by the spindle.',1,'2017-05-12 02:35:21.466389','2017-05-12 02:35:21.466396');
INSERT INTO "quiz_question" VALUES(181,'In a laser printer, what does the imaging drum do?','hardware',3,'','The imaging drum is charged in areas so in effect what is printed is first attracted onto the imaging drum. It is then transferred to the paper.',1,'2017-05-12 02:35:21.496345','2017-05-12 02:35:21.496352');
INSERT INTO "quiz_question" VALUES(182,'In laser printers, what does the laser do?','hardware',3,'','The laser precisely charges areas of the drum, which then attracts the toner to create the image, ready to be transferred to paper.',1,'2017-05-12 02:35:21.527596','2017-05-12 02:35:21.527602');
INSERT INTO "quiz_question" VALUES(183,'Who designed the difference engine?','history',3,'','The Difference Engine was an automatic mechanical calculator/computer. It wasn''t, however, the first mechanical calculator to be invented.',1,'2017-05-12 02:35:21.559875','2017-05-12 02:35:21.559881');
INSERT INTO "quiz_question" VALUES(184,'What is/was the difference engine?','history',3,'','The difference engine (which was a large mechanical computer/calculator) was invented by Charles Babbage. It wasn''t, however, the first mechanical calculator to be invented.',1,'2017-05-12 02:35:21.592835','2017-05-12 02:35:21.592840');
INSERT INTO "quiz_question" VALUES(185,'What does AMD stand for?','history',3,'','AMD are best known for their processors, which include the Athlon, Duron and Sempron.',1,'2017-05-12 02:35:21.619918','2017-05-12 02:35:21.619925');
INSERT INTO "quiz_question" VALUES(186,'When was Intel founded?','history',3,'','Intel was founded by Gordon Moore and Robert Noyce in California in 1968.',1,'2017-05-12 02:35:21.647688','2017-05-12 02:35:21.647695');
INSERT INTO "quiz_question" VALUES(187,'What is a daemon on a UNIX system?','os',3,'','A daemon does not require a user interface.',1,'2017-05-12 02:35:21.673712','2017-05-12 02:35:21.673720');
INSERT INTO "quiz_question" VALUES(188,'In DOS what does deltree do?','history',3,'','Deltree (delete tree) is a Microsoft DOS command used for deleting entire directories (folders) and subdirectories.',1,'2017-05-12 02:35:21.701213','2017-05-12 02:35:21.701228');
INSERT INTO "quiz_question" VALUES(189,'What is Microsoft''s first 32bit operating system?','history',3,'','Windows NT 3.1 was released in 1993.',1,'2017-05-12 02:35:21.741817','2017-05-12 02:35:21.741825');
INSERT INTO "quiz_question" VALUES(190,'Who supplied IBM with PC-DOS?','history',3,'','PC-DOS was Microsoft''s big break - a licensing oversight meant IBM did not have exclusive use of PC-DOS, and it could be sold to other competitors by Microsoft.',1,'2017-05-12 02:35:21.774300','2017-05-12 02:35:21.774307');
INSERT INTO "quiz_question" VALUES(191,'Who originally created the software that became MS-DOS?','history',3,'','The original name of Microsoft DOS was QDOS (Quick and Dirty Operating System). It was bought by Microsoft and then sold to IBM for use with their hardware.',1,'2017-05-12 02:35:21.800031','2017-05-12 02:35:21.800038');
INSERT INTO "quiz_question" VALUES(192,'What is IANA','network',3,'','The IANA allocates internet IP addresses',1,'2017-05-12 02:35:21.831565','2017-05-12 02:35:21.831572');
INSERT INTO "quiz_question" VALUES(193,'What is IIS?','server-software',3,'','IIS is a set of internet services for use with servers running Microsoft Windows Server.',1,'2017-05-12 02:35:21.863424','2017-05-12 02:35:21.863431');
INSERT INTO "quiz_question" VALUES(194,'What is Direct X?','tools',3,'','Direct X is used to create 2D and 3D graphics and sound for use in applications.',1,'2017-05-12 02:35:21.893835','2017-05-12 02:35:21.893843');
INSERT INTO "quiz_question" VALUES(195,'What is System Locked Preinstallation used for?','hardware',3,'','When receiving a new computer, you will often receive a restore disc. This can usually only be used in the original computer because of system Locked Preinstallation.',1,'2017-05-12 02:35:21.923964','2017-05-12 02:35:21.923971');
INSERT INTO "quiz_question" VALUES(196,'What might sysprep be used for?','windows',3,'','Once a computer is sysprepped, an image can be take from it that can then be used as a base for setting up other computers.',1,'2017-05-12 02:35:21.951771','2017-05-12 02:35:21.951785');
INSERT INTO "quiz_question" VALUES(197,'What is RIS in Windows XP?','windows',3,'','RIS allows installation of a Microsoft operating system remotely.',1,'2017-05-12 02:35:21.981149','2017-05-12 02:35:21.981155');
INSERT INTO "quiz_question" VALUES(198,'Which of the following is a Windows scripting language?','programming',3,'','VBScript (Visual Basic Scripting edition) is used for creating scripts in Windows.',1,'2017-05-12 02:35:22.013649','2017-05-12 02:35:22.013656');
INSERT INTO "quiz_question" VALUES(199,'Add the following in hexadecimal: 9h + 2h','programming',3,'','Hexadecimal is base 16, so numbers go from 0-F (F being equivalent to 15 in decimal).',1,'2017-05-12 02:35:22.047844','2017-05-12 02:35:22.047866');
INSERT INTO "quiz_question" VALUES(200,'In hexadecimal calculate the following: Bh-Ah','programming',3,'','Hexadecimal is base 16, so numbers go from 0-F (F being equivalent to 15 in decimal).',1,'2017-05-12 02:35:22.077224','2017-05-12 02:35:22.077235');
INSERT INTO "quiz_question" VALUES(201,'Which of the following is a low level programming language?','programming',3,'','A low level programming language is one that is close to what a computer can understand. Assembly is only one level up from binary language and so is a low level language.',1,'2017-05-12 02:35:22.102350','2017-05-12 02:35:22.102356');
INSERT INTO "quiz_question" VALUES(202,'What is this binary number converted to decimal - 00001010?','programming',3,'','The first bit on the right hand side is always equal to decimal 1, moving left the value is doubled each time.',1,'2017-05-12 02:35:22.130396','2017-05-12 02:35:22.130403');
INSERT INTO "quiz_question" VALUES(203,'What might you type into a ''Run'' dialogue in order to view current memory usage in Windows?','windows',3,'','Perfmon opens the performance monitor for viewing data such as processor usage and memory usage.',1,'2017-05-12 02:35:22.166304','2017-05-12 02:35:22.166310');
INSERT INTO "quiz_question" VALUES(204,'What does TFT stand for?','hardware',3,'','TFT screens are used on laptops that require thin screens.',1,'2017-05-12 02:35:22.199862','2017-05-12 02:35:22.199867');
INSERT INTO "quiz_question" VALUES(205,'What is .net framework','programming',3,'','.net framework was developed by Microsoft.',1,'2017-05-12 02:35:22.239313','2017-05-12 02:35:22.239333');
INSERT INTO "quiz_question" VALUES(206,'What is port forwarding used for?','network',3,'','It is used where NAT does not work.',1,'2017-05-12 02:35:22.269752','2017-05-12 02:35:22.269776');
INSERT INTO "quiz_question" VALUES(207,'What is NAT?','network',3,'','NAT is the process or sending data through a gateway (for example from a PC, through a router to the internet). Rather than the address of the computer being used on the internet, an external address is used by the router.',1,'2017-05-12 02:35:22.303285','2017-05-12 02:35:22.303292');
INSERT INTO "quiz_question" VALUES(208,'What is the primary role of a router?','network',3,'','A router will route data packets through computer networks to eventually arrive at their destination.',1,'2017-05-12 02:35:22.334090','2017-05-12 02:35:22.334097');
INSERT INTO "quiz_question" VALUES(209,'What might you use to connect to a network switch in order to configure it?','network',3,'','Telnet allows an administrator to connect into networked equipment in order to configure it remotely.',1,'2017-05-12 02:35:22.365383','2017-05-12 02:35:22.365390');
INSERT INTO "quiz_question" VALUES(210,'Which operating system was designed by Sun Microsystems?','os',3,'','Solaris is now called ''Oracle Solaris'' after Oracle acquired Sun in 2010.',1,'2017-05-12 02:35:22.388659','2017-05-12 02:35:22.388665');
INSERT INTO "quiz_question" VALUES(211,'Which of the following is NOT a product of Sun Microsystems?','history',3,'','Macintosh is a computer (or series of computers) developed by Apple.',1,'2017-05-12 02:35:22.415225','2017-05-12 02:35:22.415232');
INSERT INTO "quiz_question" VALUES(212,'What is the desktop heap?','os',3,'','The desktop heap is used to store visual elements of the desktop for display. If there arer oddities in the desktop''s appearance, there may be a problem with the desktop heap.',1,'2017-05-12 02:35:22.449568','2017-05-12 02:35:22.449574');
INSERT INTO "quiz_question" VALUES(213,'What might VMWare Workstation be used for?','virtualization',3,'','A virtual computer is a software mock up of a real PC. It can have hard disks, memory, operatings system and software etc',1,'2017-05-12 02:35:22.482835','2017-05-12 02:35:22.482841');
INSERT INTO "quiz_question" VALUES(214,'What is Telnet?','network',3,'','It is used to remotely connect to networked devices for administration purposes.',1,'2017-05-12 02:35:22.507977','2017-05-12 02:35:22.507983');
INSERT INTO "quiz_question" VALUES(215,'What is Telnet short for?','network',3,'','Telnet is a command-line remote connection tool.',1,'2017-05-12 02:35:22.534938','2017-05-12 02:35:22.534944');
INSERT INTO "quiz_question" VALUES(216,'In a memory stack, how is data written/read?','programming',3,'','Data that is ''pushed'' to the stack is ''popped'' off it. It can be visualised as a pile or items, one on top of the other. You must push items onto the top and pop them off the top.',1,'2017-05-12 02:35:22.562767','2017-05-12 02:35:22.562773');
INSERT INTO "quiz_question" VALUES(217,'What is a memory leak?','programming',3,'','This can cause slowdown of a computer as the memory may remain unavailable until the computer is powered down.',1,'2017-05-12 02:35:22.590609','2017-05-12 02:35:22.590616');
INSERT INTO "quiz_question" VALUES(218,'What is a comma delimited file?','programming',3,'','This may be used to store a list of numbers which can be read back into an application.',1,'2017-05-12 02:35:22.625408','2017-05-12 02:35:22.625425');
INSERT INTO "quiz_question" VALUES(219,'How might a file recovery program find deleted files?','os',3,'','When a file is deleted, only the pointer to it is deleted. Over time, the place where the data was stored is overwritten. Therefore, if file recovery is performed soon after deletion, it is likely to be successful.',1,'2017-05-12 02:35:22.658156','2017-05-12 02:35:22.658163');
INSERT INTO "quiz_question" VALUES(220,'What happens when a file is deleted?','os',3,'','When a file is deleted, only the pointer to it is deleted. Over time, the place where the data was stored is overwritten.',1,'2017-05-12 02:35:22.683612','2017-05-12 02:35:22.683618');
INSERT INTO "quiz_question" VALUES(221,'In a linux bash, how do you get the return code of the last executed command?','linux',3,'','$? displays the return code of the last executed bash command.',1,'2017-05-12 02:35:22.713324','2017-05-12 02:35:22.713331');
INSERT INTO "quiz_question" VALUES(222,'Which is the first of the following operating systems to natively support the TRIM command for solid state SATA drives?','os',3,'','Windows 7 supports the command natively, but only for SATA drives, NOT PCI-Express drives.',1,'2017-05-12 02:35:22.745049','2017-05-12 02:35:22.745056');
INSERT INTO "quiz_question" VALUES(223,'Who founded the Linux kernel?','history',3,'','He is a Finnish-American software engineer.',1,'2017-05-12 02:35:22.776231','2017-05-12 02:35:22.776238');
INSERT INTO "quiz_question" VALUES(224,'What is the name of the Linux mascot?','os',3,'','Tux the penguin has been the Linux mascot since 1996.',1,'2017-05-12 02:35:22.805661','2017-05-12 02:35:22.805668');
INSERT INTO "quiz_question" VALUES(225,'What is the name ''Microsoft'' short for?','os',3,'','Microsoft was founded on April 4th 1975, by Bill Gates and Paul Allen',1,'2017-05-12 02:35:22.833900','2017-05-12 02:35:22.833909');
INSERT INTO "quiz_question" VALUES(226,'Where did the Trojan get it''s name?','security',3,'','The name is based on the military move by the Greeks in the Trojan war using a large wooden horse (or rabbit if you''ve seen Monty Python and the Holy Grail!) to hide soldiers.',1,'2017-05-12 02:35:22.859424','2017-05-12 02:35:22.859429');
INSERT INTO "quiz_question" VALUES(227,'Which file system has an MFT?','os',3,'','MFT stands for Master File Table and is used by the NTFS file system.',1,'2017-05-12 02:35:22.892235','2017-05-12 02:35:22.892242');
INSERT INTO "quiz_question" VALUES(228,'What is an IDE?','programming',3,'','An IDE is used for developing software and has a user friendly interface to work with.',1,'2017-05-12 02:35:22.930254','2017-05-12 02:35:22.930261');
INSERT INTO "quiz_question" VALUES(229,'What is the usual role of a compiler?','programming',3,'','The compiler translates code so it can be run by the operating system.',1,'2017-05-12 02:35:22.955700','2017-05-12 02:35:22.955705');
INSERT INTO "quiz_question" VALUES(230,'How might you most efficiently roll out software over a large network?','server-software',3,'','Group policy can be used to install MSI files and also run scripts, and is a key tool for rolling out software.',1,'2017-05-12 02:35:22.982471','2017-05-12 02:35:22.982477');
INSERT INTO "quiz_question" VALUES(231,'Who were Microsoft originally hired by to develop an operating system?','history',3,'','IBM required and operating system that would run on their computer hardware. Microsoft were hired to develop the operating system, which became Microsoft DOS.',1,'2017-05-12 02:35:23.011680','2017-05-12 02:35:23.011686');
INSERT INTO "quiz_question" VALUES(232,'When was Windows 3.1 released?','history',3,'','In March 1992, Windows 3.1 (the successor to Windows 3.0) was released.',1,'2017-05-12 02:35:23.044861','2017-05-12 02:35:23.044867');
INSERT INTO "quiz_question" VALUES(233,'Which of these is NOT a version of Linux?','os',3,'','Symbian is a mobile phone operating system, and is not based on Linux.',1,'2017-05-12 02:35:23.078732','2017-05-12 02:35:23.078739');
INSERT INTO "quiz_question" VALUES(234,'What is UNIX?','os',3,'','Unix was first developed by AT&T employees in 1969.',1,'2017-05-12 02:35:23.110376','2017-05-12 02:35:23.110382');
INSERT INTO "quiz_question" VALUES(235,'What is a mainframe?','hardware',3,'','A mainframe is used for performing critical tasks. The name originally came from the cabinets used to house the computer hardware.',1,'2017-05-12 02:35:23.138671','2017-05-12 02:35:23.138677');
INSERT INTO "quiz_question" VALUES(236,'At command-line in Windows, what does the ''net start'' command do?','os',3,'','Any service can be started in Windows using the net start command (followed by the service name). To stop a service, use the ''net stop'' command.',1,'2017-05-12 02:35:23.170482','2017-05-12 02:35:23.170488');
INSERT INTO "quiz_question" VALUES(237,'What does ''net user'' allow you to do in windows?','os',3,'','Accounts can be added, removed or modified using ''net user''',1,'2017-05-12 02:35:23.202507','2017-05-12 02:35:23.202514');
INSERT INTO "quiz_question" VALUES(238,'How might you map a network drive using the command prompt in Windows 8?','os',3,'','For example to map a drive to sharedFolder1 on serverA to drive letter x, you would type "net use x: \\serverA\sharedFolder1"',1,'2017-05-12 02:35:23.234116','2017-05-12 02:35:23.234122');
INSERT INTO "quiz_question" VALUES(239,'What does COM stand for?','programming',3,'','COM is used for developing software components',1,'2017-05-12 02:35:23.259774','2017-05-12 02:35:23.259780');
INSERT INTO "quiz_question" VALUES(240,'Which of the following are part of the registry in Windows?','os',3,'','Hives are a group of keys, subkeys and values. Changelog is a log of changes made by users.',1,'2017-05-12 02:35:23.290067','2017-05-12 02:35:23.290073');
INSERT INTO "quiz_question" VALUES(241,'What does LSB stand for?','programming',3,'','The least significant bit is the right hand bit in a binary integer. It is so called as it holds the smallest value (units).',1,'2017-05-12 02:35:23.315181','2017-05-12 02:35:23.315188');
INSERT INTO "quiz_question" VALUES(242,'What is a changelog?','os',3,'','The changelog in Windows regedit for exemple, will track changes made to the registry.',1,'2017-05-12 02:35:23.352594','2017-05-12 02:35:23.352600');
INSERT INTO "quiz_question" VALUES(243,'What is reg.exe?','os',3,'','The registry can be added to, deleted from and viewed from command line. This is especially useful for automating adjustments to the registry as commands can be placed in a batch file.',1,'2017-05-12 02:35:23.386491','2017-05-12 02:35:23.386498');
INSERT INTO "quiz_question" VALUES(244,'What is DMA?','programming',3,'','DMA allows data to be transferred to physical memory (RAM), without being processed by the processor (CPU).',1,'2017-05-12 02:35:23.414421','2017-05-12 02:35:23.414428');
INSERT INTO "quiz_question" VALUES(245,'What is an argument?','programming',3,'','An argument can be any type of data the function will allow - an integer, string, floating point value, object etc.',1,'2017-05-12 02:35:23.439897','2017-05-12 02:35:23.439904');
INSERT INTO "quiz_question" VALUES(246,'Which of these is true of a virtual server?','virtualization',3,'','A virtual server is setup on server hardware, but shares that hardware with other virtual servers, instead of having multiple dedicated servers.',1,'2017-05-12 02:35:23.468283','2017-05-12 02:35:23.468291');
INSERT INTO "quiz_question" VALUES(247,'With regards to computer hardware, what is a chipset?','hardware',3,'','The chipset is normally designed to work with certain processor families (eg Pentium processors by IBM).',1,'2017-05-12 02:35:23.496905','2017-05-12 02:35:23.496913');
INSERT INTO "quiz_question" VALUES(248,'What does CRC stand for?','os',3,'','A CRC checks for errors in data.',1,'2017-05-12 02:35:23.528443','2017-05-12 02:35:23.528450');
INSERT INTO "quiz_question" VALUES(249,'What is TCP port 80 normally reserved for?','network',3,'','HTTP uses port 80, HTTPS (HTTP secure) uses port 443.',1,'2017-05-12 02:35:23.555832','2017-05-12 02:35:23.555841');
INSERT INTO "quiz_question" VALUES(250,'What is DEP?','os',3,'','DEP is designed to prevent software from running code from non executable areas of memory.',1,'2017-05-12 02:35:23.582792','2017-05-12 02:35:23.582799');
INSERT INTO "quiz_question" VALUES(251,'What number, in binary, represents the number 10 in decimal?','programming',3,'','Starting from the right: 0x1, 1x2, 0x4, 1x8',1,'2017-05-12 02:35:23.613335','2017-05-12 02:35:23.613341');
INSERT INTO "quiz_question" VALUES(252,'What is Device Manager NOT used for in Windows?','windows',3,'','Device manager can show driver information and hardware status. It can also be used for adjusting hardware including changing drivers.',1,'2017-05-12 02:35:23.645674','2017-05-12 02:35:23.645680');
INSERT INTO "quiz_question" VALUES(253,'What is a hardware profile used for?','windows',3,'','You may want to disable certain devices at startup (for example to prolong battery life on a laptop). Hardware profiles can be used for this purpose.',1,'2017-05-12 02:35:23.673135','2017-05-12 02:35:23.673142');
INSERT INTO "quiz_question" VALUES(254,'What is code signing useful for?','security',3,'','The author of software is a good tool to prevent against malware (which may be disguised as a legitimate, well known program).',1,'2017-05-12 02:35:23.699333','2017-05-12 02:35:23.699338');
INSERT INTO "quiz_question" VALUES(255,'What is a distributed file system?','os',3,'','A dstributed file system (DFS) allows access to shared data from multiple hosts.',1,'2017-05-12 02:35:23.726699','2017-05-12 02:35:23.726706');
INSERT INTO "quiz_question" VALUES(256,'Which of the following is NOT a Windows recovery console command?','windows',3,'','Defrag is NOT a recovery console command - it is short for defragmenter/defragment.',1,'2017-05-12 02:35:23.759660','2017-05-12 02:35:23.759666');
INSERT INTO "quiz_question" VALUES(257,'What does the Kernel of an operating system do?','os',3,'','The kernel is the lowest level of an operating system, and provides the core. The same kernel may be used in multiple operating systems.',1,'2017-05-12 02:35:23.789384','2017-05-12 02:35:23.789390');
INSERT INTO "quiz_question" VALUES(258,'What does NTFS stand for?','os',3,'','NTFS is a files system used in a number of Windows operating systems including Windows NT, 2000, XP, Vista, and 7.',1,'2017-05-12 02:35:23.820141','2017-05-12 02:35:23.820148');
INSERT INTO "quiz_question" VALUES(259,'What is NTLDR?','os',3,'','NTLDR is short for NT Loader. It is used in the bootup of the operating system.',1,'2017-05-12 02:35:23.845390','2017-05-12 02:35:23.845397');
INSERT INTO "quiz_question" VALUES(260,'What can boot.ini be used for?','os',3,'','Startup options are stored in boot.ini, and so can be manually edited (eg the default operating system in a multiboot environment can be changed).',1,'2017-05-12 02:35:23.876891','2017-05-12 02:35:23.876899');
INSERT INTO "quiz_question" VALUES(261,'Which of the following is the lowest level programming language?','programming',3,'','Assembly language works at a level closest to what a computer can actually understand, and so is considered low level. The others listed are high level programming languages.',1,'2017-05-12 02:35:23.908070','2017-05-12 02:35:23.908078');
INSERT INTO "quiz_question" VALUES(262,'How is data stored on a CD?','hardware',3,'','The CD writer burns a small hole (bump) in the CD to represent a 1, and the flat areas represent 0''s. These are read back when the laser shines on the disc - if data is reflected (by a flat area) then the 0 is read. If there is a bump the laser is deflected elsewhere and a 1 is read.',1,'2017-05-12 02:35:23.944813','2017-05-12 02:35:23.944820');
INSERT INTO "quiz_question" VALUES(263,'Add the following binary numbers: 01010101 + 10101010','programming',3,'','Adding is done is binary in the same way as decimal, except instead of counting to 9 then next going back to 0 and carrying over the 1, you count up the 1 then next go back to 0 and carry over the 1.',1,'2017-05-12 02:35:23.985830','2017-05-12 02:35:23.985836');
INSERT INTO "quiz_question" VALUES(264,'In binary, calculate 00001111-00000011','programming',3,'','The subtraction process is the same as with decimal, just remember the largest digit you can use is a 1.',1,'2017-05-12 02:35:24.009994','2017-05-12 02:35:24.010000');
INSERT INTO "quiz_question" VALUES(265,'Which of the following is NOT an 8086 assembly language command?','programming',3,'','All the others are valid commands (pop - pops data from the stack, push pushes data onto the stack, add adds two values)',1,'2017-05-12 02:35:24.036916','2017-05-12 02:35:24.036923');
INSERT INTO "quiz_question" VALUES(266,'What would a hash value NOT be used for?','security',3,'','A hash value can be used to verify data by creating a hash of the original and comparing it to the end result (eg downloaded file).',1,'2017-05-12 02:35:24.073639','2017-05-12 02:35:24.073645');
INSERT INTO "quiz_question" VALUES(267,'What might a checksum be used for?','security',3,'','The checksum produced from the original can be compared to the one in question. If the data is different, the checksum will be different.',1,'2017-05-12 02:35:24.100651','2017-05-12 02:35:24.100658');
INSERT INTO "quiz_question" VALUES(268,'Add the following binary numbers together: 00000100 + 00000100','programming',3,'','Adding is done is binary in the same way as decimal, except instead of counting to 9 then next going back to 0 and carrying over the 1, you count up the 1 then next go back to 0 and carry over the 1.',1,'2017-05-12 02:35:24.131463','2017-05-12 02:35:24.131470');
INSERT INTO "quiz_question" VALUES(269,'What is DHCP used for?','network',3,'','DHCP is used so that each device automatically receives an IP address when joining the network, rather than being assigned one manually by the administrator.',1,'2017-05-12 02:35:24.158302','2017-05-12 02:35:24.158309');
INSERT INTO "quiz_question" VALUES(270,'Which is usually faster?','hardware',3,'','The processor is the fastest part of a computer. Out of the above list, the slowest is the hard disk as it (usually) has moving parts.',1,'2017-05-12 02:35:24.188893','2017-05-12 02:35:24.188901');
INSERT INTO "quiz_question" VALUES(271,'What does DDR stand for?','hardware',3,'','DDR is a property of physical memory (RAM).',1,'2017-05-12 02:35:24.223348','2017-05-12 02:35:24.223355');
INSERT INTO "quiz_question" VALUES(272,'Add the following hexadecimal numbers: 00FFh + 00AAh','programming',3,'','Hexadecimal is base 16, so numbers go from 0-F (F being equivalent to 15 in decimal).',1,'2017-05-12 02:35:24.253543','2017-05-12 02:35:24.253551');
INSERT INTO "quiz_question" VALUES(273,'In hex, calculate FFFF-AAAA','programming',3,'','As with any number base, perform the calculation the same as you would with decimal, but remember that numbers go from 0 to F, not 0 to 9.',1,'2017-05-12 02:35:24.280143','2017-05-12 02:35:24.280151');
INSERT INTO "quiz_question" VALUES(274,'What is SDLC?','programming',3,'','The name says it all - it is the process (or lifecycle) of software development.',1,'2017-05-12 02:35:24.307569','2017-05-12 02:35:24.307579');
INSERT INTO "quiz_question" VALUES(275,'What does TTL stand for?','network',3,'','It may apply to data on a network for example, to prevent data packets being infinitely looped around the network. When the TTL has run out, the data is discarded.',1,'2017-05-12 02:35:24.336339','2017-05-12 02:35:24.336345');
INSERT INTO "quiz_question" VALUES(276,'How large is an IPv6 address?','network',3,'','Internet Protocol Version 6 is intended to succeed the current version 4. An IPv4 address, in comparison, is 32 bits.',1,'2017-05-12 02:35:24.368837','2017-05-12 02:35:24.368844');
INSERT INTO "quiz_question" VALUES(277,'In Windows computer management, what is ODBC used for?','windows',3,'','ODBC allows applications to connect to databases stored on servers.',1,'2017-05-12 02:35:24.413542','2017-05-12 02:35:24.413549');
INSERT INTO "quiz_question" VALUES(278,'What might you do first if laser printing produces faded areas?','hardware',3,'','Toner powder inside the cartridge can be unevenly spread out. Shaking it gently (ensuring the powder does not escape) will spread it out so pages print evenly.',1,'2017-05-12 02:35:24.441460','2017-05-12 02:35:24.441467');
INSERT INTO "quiz_question" VALUES(279,'What does the bootstrap loader do?','os',3,'','The bootstrap loaded is designed to start up the PC and initialise peripherals, then start the operating system.',1,'2017-05-12 02:35:24.470982','2017-05-12 02:35:24.470990');
INSERT INTO "quiz_question" VALUES(280,'What is EEPROM?','hardware',3,'','Electronically Erasable Programmable Read Only Memory. Data on a flash drive, for example, is EEPROM - it does not require power to maintain data.',1,'2017-05-12 02:35:24.505343','2017-05-12 02:35:24.505349');
INSERT INTO "quiz_question" VALUES(281,'What software might you use in Windows XP to prepare a system to be imaged?','windows',3,'','Sysprep is used to create an ''system image'', so that other similar devices can be created from that ''system image'' (rather than installing operating system and software from scratch).',1,'2017-05-12 02:35:24.533862','2017-05-12 02:35:24.533870');
INSERT INTO "quiz_question" VALUES(282,'What is an IRQ?','programming',3,'','An IRQ is sent from a device to the microprocessor via electrical signal.',1,'2017-05-12 02:35:24.562058','2017-05-12 02:35:24.562080');
INSERT INTO "quiz_question" VALUES(283,'What command might be entered to open the Add/Remove programs window from the command prompt?','windows',3,'','Appwiz.cpl opens the add/remove dialog where installed programs can be viewed or changed, and new programs/features added.',1,'2017-05-12 02:35:24.589145','2017-05-12 02:35:24.589154');
INSERT INTO "quiz_question" VALUES(284,'What is the IEEE standard 802.3?','network',3,'','Ethernet was introduced in 1980 and is widely used today.',1,'2017-05-12 02:35:24.615041','2017-05-12 02:35:24.615047');
