INSERT INTO "quiz_question" VALUES(286,'Which of the following switches will cancel a Windows shutdown that is in progress?','windows',3,'','The command ''shutdown -a'' will abort the shutdown of a computer.',1,'2017-05-12 02:35:24.685801','2017-05-12 02:35:24.685810');
INSERT INTO "quiz_question" VALUES(287,'What is X.500?','os',3,'','X.500 was first approved in 1988.',1,'2017-05-12 02:35:24.712352','2017-05-12 02:35:24.712358');
INSERT INTO "quiz_question" VALUES(288,'Where would you find a Virtual Function?','programming',3,'','Object-oriented programming languages include C++, Java and Python along with numerous others.',1,'2017-05-12 02:35:24.739268','2017-05-12 02:35:24.739275');
INSERT INTO "quiz_question" VALUES(289,'What is LDAP?','network',3,'','It stands for Lightweight Directory Access Protocol.',1,'2017-05-12 02:35:24.770243','2017-05-12 02:35:24.770248');
INSERT INTO "quiz_question" VALUES(290,'Which of the following is the closest Unix equivelant to the ''dir'' command in Windows command line?','linux',3,'','The ls command will list the contents of the current directory.',1,'2017-05-12 02:35:24.800230','2017-05-12 02:35:24.800236');
INSERT INTO "quiz_question" VALUES(291,'A program written in Java can run on?','os',3,'','Java programs are not dependant on the specific operating system to run. As long as the correct version of Java is installed on the system, the program will run.',1,'2017-05-12 02:35:24.845790','2017-05-12 02:35:24.845808');
INSERT INTO "quiz_question" VALUES(292,'Which of the following would create one file from another on a Linux system where fileA is the source and fileB is the destination?','linux',3,'','The cp command is a copy command, and will copy fileA to make fileB.',1,'2017-05-12 02:35:24.882997','2017-05-12 02:35:24.883004');
INSERT INTO "quiz_question" VALUES(293,'What is DAT?','hardware',3,'','Digital Audio Tape was developed by Sony as stores data digitally on magnetic tape.',1,'2017-05-12 02:35:24.911761','2017-05-12 02:35:24.911769');
INSERT INTO "quiz_question" VALUES(294,'What does the FIRST D stand for in DDoS?','security',3,'','A DDoS attack is a Distributed Denial of Service attack - for example multiple computers are compromised to flood a particular website with traffic, in order that the website become unusable to the public during the attack.',1,'2017-05-12 02:35:24.942924','2017-05-12 02:35:24.942942');
INSERT INTO "quiz_question" VALUES(295,'What does the P stand for in AGP?','hardware',3,'','AGP stands for Accelerated Graphics Port.',1,'2017-05-12 02:35:24.973370','2017-05-12 02:35:24.973378');
INSERT INTO "quiz_question" VALUES(296,'Where might you use a cascading style sheet?','programming',3,'','CSS is used to lay out web pages.',1,'2017-05-12 02:35:25.006889','2017-05-12 02:35:25.006897');
INSERT INTO "quiz_question" VALUES(297,'What is used to split values in a CSV file?','programming',3,'','CSV is short for Comma-Separated Values. The comma sits between each value so it can be read in by various applications.',1,'2017-05-12 02:35:25.031832','2017-05-12 02:35:25.031845');
INSERT INTO "quiz_question" VALUES(298,'In the term ''rootkit'', what is the ''root''?','security',3,'','The root account has full access to a Unix system.',1,'2017-05-12 02:35:25.061844','2017-05-12 02:35:25.061850');
INSERT INTO "quiz_question" VALUES(299,'What was included, as part of Digital Rights Managent, on some Sony BMG music CD''s?','security',3,'','Sony BMG included a rootkit with CDs, which exposed administrator privileges on Windows computers. This rootkit installed when the CD was played on Windows computers.',1,'2017-05-12 02:35:25.100396','2017-05-12 02:35:25.100403');
INSERT INTO "quiz_question" VALUES(300,'How might a rootkit be installed on a PC?','security',3,'','The install may happen in the same way as a virus, although the rootkit is usually much more difficult to find and remove due to it''s deep install location, administrator priveleges and silent nature.',1,'2017-05-12 02:35:25.127364','2017-05-12 02:35:25.127372');
INSERT INTO "quiz_question" VALUES(301,'Which is true of a firmware rootkit (in this example, let''s say it is installed on a network card)?','security',3,'','If the firmware rootkit is particularly problematic, the hardware may need replacing.',1,'2017-05-12 02:35:25.154664','2017-05-12 02:35:25.154670');
INSERT INTO "quiz_question" VALUES(302,'What might be a use of polymorphic code?','security',3,'','The polymorphic code changes each time it is run, although the fundamentals stay the same. This makes the code more difficult for anti virus software to detect.',1,'2017-05-12 02:35:25.184004','2017-05-12 02:35:25.184010');
INSERT INTO "quiz_question" VALUES(303,'What is true of a Man In The Middle Attack (MITM)?','security',3,'','In this kind of attack, Tom may recieve a message he thinks is from Lisa. He will reply to this message. The MITM actually sent the original message so it appeared to be from Lisa, and he will also recieve the reply from Tom.',1,'2017-05-12 02:35:25.210737','2017-05-12 02:35:25.210743');
INSERT INTO "quiz_question" VALUES(304,'What does the D stand for in CIDR?','network',4,'','CIDR: Classles InterDomain Routing',1,'2017-05-12 02:35:25.243413','2017-05-12 02:35:25.243420');
INSERT INTO "quiz_question" VALUES(305,'What is the development language of Apple iPhone apps?','programming',3,'','Objective C is used to develop iPhone apps (Java is used for Android apps).',1,'2017-05-12 02:35:25.275288','2017-05-12 02:35:25.275294');
INSERT INTO "quiz_question" VALUES(306,'What is a brute force attack in terms of data that is encrypted?','security',3,'','A brute force attack is usually a last resort if other methods of accessing encrypted data are not possible. A simillar example is trying to find a personal 4 digit pin (such as for a credit card), when you don''t know any of the digits. You start at 0000, then 0001 etc (this is one of the reasons you only get three attempts at the cash machine!)',1,'2017-05-12 02:35:25.308621','2017-05-12 02:35:25.308627');
INSERT INTO "quiz_question" VALUES(307,'Who was NOT a founder of Apple Inc?','history',3,'','Paul Allen is one of the founders of Microsoft, not Apple.',1,'2017-05-12 02:35:25.335309','2017-05-12 02:35:25.335315');
INSERT INTO "quiz_question" VALUES(308,'Which command, in Windows 7, will open Task Manager?','windows',3,'','Task manager provides control over running programs and processes.',1,'2017-05-12 02:35:25.362173','2017-05-12 02:35:25.362179');
INSERT INTO "quiz_question" VALUES(309,'CUDA and PhysX are related to what?','hardware',3,'','CUDA and PhysX are NVidia''s Graphics Processing hardware and software technology involving physics and advanced mathematics.',1,'2017-05-12 02:35:25.391522','2017-05-12 02:35:25.391528');
INSERT INTO "quiz_question" VALUES(310,'Which of the following typically uses UDP as the transmission protocol?','network',3,'','SNMP typically uses UDP (User Datagram Protocol) as a transmission protocol',1,'2017-05-12 02:35:25.412928','2017-05-12 02:35:25.412949');
INSERT INTO "quiz_question" VALUES(311,'What is used to develop Windows 8 Store apps?','programming',3,'','WinRT is short for Windows Runtime.',1,'2017-05-12 02:35:25.438747','2017-05-12 02:35:25.438754');
INSERT INTO "quiz_question" VALUES(312,'In which year was the idea of the World Wide Web developed?','network',3,'','It was founded by Tim Berners Lee',1,'2017-05-12 02:35:25.464591','2017-05-12 02:35:25.464597');
INSERT INTO "quiz_question" VALUES(313,'What bash command do you need to start X11 on a Linux system that uses it?','linux',3,'','''startx'' is used to start up X11, the GUI used in most Linux distributions.',1,'2017-05-12 02:35:25.490340','2017-05-12 02:35:25.490346');
INSERT INTO "quiz_question" VALUES(314,'On computers running a Unix based operating system, what is "Bash"?','linux',3,'','Bash is a command line shell for Unix systems such as Linux.',1,'2017-05-12 02:35:25.525078','2017-05-12 02:35:25.525084');
INSERT INTO "quiz_question" VALUES(315,'Who is the linux distro "Backtrack" OS aimed at?','linux',3,'','Backtrack is a linux distro designed for hackers and pen testers, with an abundant arsenal of tools making it a very popular OS.',1,'2017-05-12 02:35:25.557096','2017-05-12 02:35:25.557102');
INSERT INTO "quiz_question" VALUES(316,'Which computer brand got its name from a mythological creature?','history',3,'','Asus derived the name from the mythological horse named Pegasus',1,'2017-05-12 02:35:25.583347','2017-05-12 02:35:25.583353');
INSERT INTO "quiz_question" VALUES(317,'What does RAID stand for?','os',3,'','A RAID setup combines multiple disk drives into one logical unit.',1,'2017-05-12 02:35:25.613037','2017-05-12 02:35:25.613043');
INSERT INTO "quiz_question" VALUES(318,'What is SCCM?','server-software',3,'','SCCM is a system management product by Microsoft for managing multiple Windows based computer systems.',1,'2017-05-12 02:35:25.642118','2017-05-12 02:35:25.642125');
INSERT INTO "quiz_question" VALUES(319,'What is an advantage of data striping?','os',3,'','Data for a single file, for example, is storage across several storage devices (so several parts can be accessed at the same time).',1,'2017-05-12 02:35:25.670800','2017-05-12 02:35:25.670807');
INSERT INTO "quiz_question" VALUES(320,'What does SONET stand for?','network',3,'','It is used to send multiple bit streams over fibre optic cable.',1,'2017-05-12 02:35:25.711793','2017-05-12 02:35:25.711799');
INSERT INTO "quiz_question" VALUES(321,'What does the O stand for in CMOS?','hardware',3,'','CMOS stands for Complimentary Metal Oxide semiconductor, and  is a technology for constructing integrated circuits that are used on a nano meter scale (tiny electrical circuits).',1,'2017-05-12 02:35:25.743965','2017-05-12 02:35:25.743973');
INSERT INTO "quiz_question" VALUES(322,'What is stored in an NK2 file?','tools',3,'','The NK2 file stores details of frequent recipients and email addresses for Microsoft Outlook',1,'2017-05-12 02:35:25.771309','2017-05-12 02:35:25.771315');
INSERT INTO "quiz_question" VALUES(323,'In the Python programming language, what is a Tuple?','programming',3,'','A Tuple is similar to a list, only it is immutable (cannot be changed). A Tuple can be cast to a list if the programmer later decides s/he needs to make changes to it.',1,'2017-05-12 02:35:25.807833','2017-05-12 02:35:25.807839');
INSERT INTO "quiz_question" VALUES(324,'What does COBOL stand for?','programming',3,'','One of the first 3rd generation languages, useful for file management. It is very wordy like written English for ease of understanding.',1,'2017-05-12 02:35:25.837139','2017-05-12 02:35:25.837145');
INSERT INTO "quiz_question" VALUES(325,'What was the original name for the Java programming language?','history',4,'','The name Oak came from an Oak tree outside James Gosling''s office window (Gosling being one of the founders of Java/Oak).',1,'2017-05-12 02:35:25.864350','2017-05-12 02:35:25.864356');
INSERT INTO "quiz_question" VALUES(326,'Which of the following is designed specifically for embedded devices?','programming',4,'','Java ME is used for embedded devices - ME stands for Micro Edition.',1,'2017-05-12 02:35:25.895684','2017-05-12 02:35:25.895691');
INSERT INTO "quiz_question" VALUES(327,'Which is NOT true of using 2''s complement to represent binary numbers?','programming',4,'','This is NOT true - in 2''s complement 0 is represented only once.',1,'2017-05-12 02:35:25.923151','2017-05-12 02:35:25.923157');
INSERT INTO "quiz_question" VALUES(328,'What is the ASCII character code (decimal) for the character ''carriage return''?','programming',4,'','There are 128 ASCII characters in total - many are not graphical characters.',1,'2017-05-12 02:35:25.961475','2017-05-12 02:35:25.961482');
INSERT INTO "quiz_question" VALUES(329,'What does the ''P'' stand for in ARPANET?','history',4,'','ARPA - Advanced Research Projects Agency - ARPANET was the world''s first packet switching network.',1,'2017-05-12 02:35:25.992694','2017-05-12 02:35:25.992700');
INSERT INTO "quiz_question" VALUES(330,'In Octal, what is 7+1?','programming',4,'','Remember, after 7oct you must carry the 1 the next next column on the left, making 10oct.',1,'2017-05-12 02:35:26.018931','2017-05-12 02:35:26.018937');
INSERT INTO "quiz_question" VALUES(331,'Convert 1011b (binary) to hexadecimal','programming',4,'','Hexadecimal is base 16, so numbers go from 0-F (F being equivalent to 15 in decimal). Binary is base 2 and only 0 and 1 are used.',1,'2017-05-12 02:35:26.047085','2017-05-12 02:35:26.047092');
INSERT INTO "quiz_question" VALUES(332,'Convert 1111 from binary to octal','programming',4,'','Octal is base 8 and so uses only the numbers 0 to 7. Binary is base 2 and uses only 0 to 1.',1,'2017-05-12 02:35:26.079807','2017-05-12 02:35:26.079814');
INSERT INTO "quiz_question" VALUES(333,'What does the command DF do at the Linux Bash command line?','linux',4,'','DF displays details of the current free space. It is displayed in the command prompt.',1,'2017-05-12 02:35:26.105059','2017-05-12 02:35:26.105068');
INSERT INTO "quiz_question" VALUES(334,'What is 2''s complement used to represent in binary?','programming',4,'','2''s complement solves the dilema of working with only 0''s and 1''s (no ''-'' symbol to represent negative).',1,'2017-05-12 02:35:26.144343','2017-05-12 02:35:26.144351');
INSERT INTO "quiz_question" VALUES(335,'What might the following command do in Windows: SUBST?','windows',4,'','It is the basis of the drive mapping function in Windows.',1,'2017-05-12 02:35:26.175548','2017-05-12 02:35:26.175555');
INSERT INTO "quiz_question" VALUES(336,'What does INT mean in Intel x86 assembly language?','programming',4,'','Interrupts can be run to perform certain operations using the processor.',1,'2017-05-12 02:35:26.203552','2017-05-12 02:35:26.203560');
INSERT INTO "quiz_question" VALUES(337,'Where might you use the ''conf t'' command?','network',4,'','It is short for ''CONFigure Terminal''.',1,'2017-05-12 02:35:26.239160','2017-05-12 02:35:26.239167');
INSERT INTO "quiz_question" VALUES(338,'What do fa and gi stand for when configuring a CISCO switch?','network',4,'','Fast Ethernet is 100 Megabits per second, Gigabit Ethernet is 1 Gigabit per second.',1,'2017-05-12 02:35:26.269639','2017-05-12 02:35:26.269647');
INSERT INTO "quiz_question" VALUES(339,'What is dark fibre?','network',4,'','Dark fibre is so called because fibre optic cabling transmits data by light, so a lack of data means no light.',1,'2017-05-12 02:35:26.297999','2017-05-12 02:35:26.298006');
INSERT INTO "quiz_question" VALUES(340,'In 80xx microprocessor architechture, which of the following is an 8 bit general purpose register?','programming',4,'','A list of all 8 bit registers: AH, AL, BH, BL, CH, CL, DH, DL (H and L being High and Low respectively).',1,'2017-05-12 02:35:26.325552','2017-05-12 02:35:26.325570');
INSERT INTO "quiz_question" VALUES(341,'In 80xxx microprocessor architechture, which of the following is a 32 bit general purpose register?','programming',4,'','A list of all 32 bit registers: EAX, EBX, ECX, EDX',1,'2017-05-12 02:35:26.351864','2017-05-12 02:35:26.351870');
INSERT INTO "quiz_question" VALUES(342,'In 8086 microprocessor architecture, what does IP stand for?','programming',4,'','This points to the NEXT instruction that will be executed in the CPU.',1,'2017-05-12 02:35:26.387371','2017-05-12 02:35:26.387399');
INSERT INTO "quiz_question" VALUES(343,'Who developed TASM?','history',4,'','TASM is short for Turbo Assembler, and is an assembler package.',1,'2017-05-12 02:35:26.421155','2017-05-12 02:35:26.421163');
INSERT INTO "quiz_question" VALUES(344,'Using 2''s complement, negate the following binary number: 11100110','programming',4,'','To negate a binary number using 2''s complement: Invert all bits (so our example becomes 00011001), then add 1 to the inverted number.',1,'2017-05-12 02:35:26.448046','2017-05-12 02:35:26.448052');
INSERT INTO "quiz_question" VALUES(345,'What type of data structure is a stack?','data-structures',4,'','Last In First Out - The last item pushed onto the stack is popped off first. Picture a stack as a stack of books - you must add books to the top of the pile or take from the top.',1,'2017-05-12 02:35:26.478281','2017-05-12 02:35:26.478287');
INSERT INTO "quiz_question" VALUES(346,'What type of data structure is a queue?','data-structures',4,'','First In First Out. Picture a queue of people - the first person (data item) in the queue is the first to leave the queue at the front. Additional people (data) joins at the back of the queue.',1,'2017-05-12 02:35:26.505156','2017-05-12 02:35:26.505162');
INSERT INTO "quiz_question" VALUES(347,'What is the main use of a namespace in C++?','programming',4,'','Due to the fact that functions can be shared for use by other developers, it is common for multiple functions to share the same name. A namespace ''categorises'' these functions so they do not exist in the same namespace.',1,'2017-05-12 02:35:26.531445','2017-05-12 02:35:26.531452');
INSERT INTO "quiz_question" VALUES(348,'In which language would you find the function malloc?','programming',4,'','The malloc() function allocates blocks of memory in the C programming language.',1,'2017-05-12 02:35:26.564295','2017-05-12 02:35:26.564301');
INSERT INTO "quiz_question" VALUES(349,'Which of the following holds file access information?','programming',4,'','MAC stands for Modification time, Access time, Change time.',1,'2017-05-12 02:35:26.603180','2017-05-12 02:35:26.603186');
INSERT INTO "quiz_question" VALUES(350,'Who originally developed the Fortran programming language?','history',4,'','FORTRAN was developed in 1950''s. The name stands for FORmula TRANslating system.',1,'2017-05-12 02:35:26.632009','2017-05-12 02:35:26.632016');
INSERT INTO "quiz_question" VALUES(351,'What is Fortran?','programming',4,'','FORTRAN was developed in 1950''s. The name stands for FORmula TRANslating system.',1,'2017-05-12 02:35:26.673636','2017-05-12 02:35:26.673659');
INSERT INTO "quiz_question" VALUES(352,'What is ELKS otherwise knows as?','history',4,'','ELKS stands for ''Embeddable Linux Kernel System''',1,'2017-05-12 02:35:26.704860','2017-05-12 02:35:26.704874');
INSERT INTO "quiz_question" VALUES(353,'What is the surname of the creator of Java?','history',4,'','His full name is James Gosling.',1,'2017-05-12 02:35:26.735111','2017-05-12 02:35:26.735118');
INSERT INTO "quiz_question" VALUES(354,'What is the name of the Java mascot?','history',4,'','Duke has always been the mascot for Java.',1,'2017-05-12 02:35:26.768506','2017-05-12 02:35:26.768522');
INSERT INTO "quiz_question" VALUES(355,'Running the command mmsys.cpl will do what in Windows 7?','windows',4,'','From these settings options such as the default playback device can be changed.',1,'2017-05-12 02:35:26.794344','2017-05-12 02:35:26.794350');
INSERT INTO "quiz_question" VALUES(356,'Which of the following will open the ODBC settings on a Windows XP computer?','os',4,'','ODBC stands for Open Database Connectivity, and is used to create connections to shared databases.',1,'2017-05-12 02:35:26.834264','2017-05-12 02:35:26.834271');
INSERT INTO "quiz_question" VALUES(357,'Which of the following will open the ODBC settings on a Windows 7 computer?','os',4,'','ODBC stands for Open Database Connectivity, and is used to create connections to shared databases.',1,'2017-05-12 02:35:26.860589','2017-05-12 02:35:26.860597');
INSERT INTO "quiz_question" VALUES(358,'A file with the extension .VHD is primarily used for what?','os',4,'','VHD stands for Virtual Hard Disk - a software representation of a hard disk drive.',1,'2017-05-12 02:35:26.885046','2017-05-12 02:35:26.885051');
INSERT INTO "quiz_question" VALUES(359,'What year was the game Doom released for the PC (sorry, had to get a Doom question in...)?','history',4,'','It was released by ''id Software''.',1,'2017-05-12 02:35:26.915106','2017-05-12 02:35:26.915113');
INSERT INTO "quiz_question" VALUES(360,'What would the following command do on a CISCO switch: switchport access vlan 978','network',4,'','The command must be run whilst configuring the terminal (after using the ''conf t'' command).',1,'2017-05-12 02:35:26.942079','2017-05-12 02:35:26.942085');
INSERT INTO "quiz_question" VALUES(361,'In Java programming, what does the A stand for in AWT?','programming',4,'','AWT stands for Abstract Window Toolkit, and is used for creating window based graphical user interfaces.',1,'2017-05-12 02:35:26.968466','2017-05-12 02:35:26.968473');
INSERT INTO "quiz_question" VALUES(362,'What does ATAPI stand for?','history',4,'','ATAPI is a connection standard for connecing storage devices.',1,'2017-05-12 02:35:27.001803','2017-05-12 02:35:27.001809');
INSERT INTO "quiz_question" VALUES(363,'What does GRUB stand for in a Linux system?','os',4,'','Grub is used to load the Linux operating system.',1,'2017-05-12 02:35:27.041202','2017-05-12 02:35:27.041208');
INSERT INTO "quiz_question" VALUES(364,'In Assembly language, what does JNE stand for?','programming',4,'','JNE is used to compare two values, and check if they are the same. If they are not, the jump is made to another section of code.',1,'2017-05-12 02:35:27.067677','2017-05-12 02:35:27.067684');
INSERT INTO "quiz_question" VALUES(365,'In Assembly language, what does JNZ stand for?','programming',4,'','JNZ compares a value to zero. If it equals zero, then the jump is made to another section of code.',1,'2017-05-12 02:35:27.097665','2017-05-12 02:35:27.097671');
INSERT INTO "quiz_question" VALUES(366,'Which command, in Windows 7, will open Authorization Manager?','os',4,'','AzMan provides role based access control for applications.',1,'2017-05-12 02:35:27.129705','2017-05-12 02:35:27.129712');
INSERT INTO "quiz_question" VALUES(367,'What type of vulnerability does SQL Injection exploit?','security',4,'','SQL injection is a technique used to access directories in a webserver and view databases.',1,'2017-05-12 02:35:27.156297','2017-05-12 02:35:27.156303');
INSERT INTO "quiz_question" VALUES(368,'What is the output of a 1,1 input on a 2 input XOR gate','programming',4,'','An xor gate produces a 1 as its output if either input is a 1 not both, not neither',1,'2017-05-12 02:35:27.185652','2017-05-12 02:35:27.185660');
INSERT INTO "quiz_question" VALUES(369,'Which Linux command gives IP address details?','linux',1,'','This shows the machine address and subnet mask (which octets define the local network and which specify the host). It stands for Interface Config.',1,'2017-05-12 02:35:27.218052','2017-05-12 02:35:27.218058');
INSERT INTO "quiz_question" VALUES(370,'What does a DNS server do?','network',1,'','DNS servers receive domain names and output the corresponding IP addresses for browsers on client machines to instantiate connections with servers.',1,'2017-05-12 02:35:27.244226','2017-05-12 02:35:27.244233');
INSERT INTO "quiz_question" VALUES(371,'Who invented the World Wide Web?','history',1,'','He was a physicist and his invention in 1990 increased the number of Internet users from 300,000 to a million in one year (the Internet was already 20 years old).',1,'2017-05-12 02:35:27.283804','2017-05-12 02:35:27.283810');
INSERT INTO "quiz_question" VALUES(372,'In Java, which is true of object constructors?','programming',3,'','Constructors are usually for initialising objects'' instance variables and have the same name as the class they are in.',1,'2017-05-12 02:35:27.310032','2017-05-12 02:35:27.310039');
INSERT INTO "quiz_question" VALUES(373,'What style of writing is preferred for variable and subroutine names in most programming languages?','programming',3,'','itIsSoCalledAsTheWholeNameIsASingleWordContainingCapitalsWhichDenoteBeginningsOfWordsWithinTheName. The first letter of the first word is lower case.',1,'2017-05-12 02:35:27.338483','2017-05-12 02:35:27.338490');
INSERT INTO "quiz_question" VALUES(374,'Who invented the first mechanical calculator?','history',4,'','Blaise Pascal invented the first, in 1642. The large cuboids were called ''Pascalines'', but weren''t programmable.',1,'2017-05-12 02:35:27.366462','2017-05-12 02:35:27.366479');
INSERT INTO "quiz_question" VALUES(375,'What is a "string" in a programming language?','programming',3,'','A string is simply a line of characters.',1,'2017-05-12 02:35:27.396348','2017-05-12 02:35:27.396373');
INSERT INTO "quiz_question" VALUES(376,'Where will you find the following line in a HTML document: ''www.W3.org''?','programming',3,'','The W3 statement will allways be placed at the start of a HTML document.',1,'2017-05-12 02:35:27.421907','2017-05-12 02:35:27.421913');
INSERT INTO "quiz_question" VALUES(377,'Which of these is NOT a web server software?','tools',4,'','X server is the server counterpart of the X Window System in UNIX, and has nothing to do with web servers.',1,'2017-05-12 02:35:27.464935','2017-05-12 02:35:27.464951');
INSERT INTO "quiz_question" VALUES(378,'Which of these is NOT a network analysis tool?','tools',4,'','tcpdump dumps traffic on a network. wireshark is a network traffic analyzer. nmap is a network security auditing tool. that leaves us with screen, which is a terminal multiplexer tool.',1,'2017-05-12 02:35:27.494970','2017-05-12 02:35:27.494979');
INSERT INTO "quiz_question" VALUES(379,'What is the purpose of the -h flag of the ls command in UNIX?','tools',4,'','When used together with the -l flag for long format, the -h makes the ls command print file sizes in human readable format like 1K, 234M, 2G.',1,'2017-05-12 02:35:27.523672','2017-05-12 02:35:27.523688');
INSERT INTO "quiz_question" VALUES(380,'Which of the following languages is NOT in the same group as LISP?','programming',4,'','LISP, R, Scheme, and Scala are all functional languages. C++ is an imperative language.',1,'2017-05-12 02:35:27.556880','2017-05-12 02:35:27.556900');
INSERT INTO "quiz_question" VALUES(381,'Which of the following languages is NOT in the same group as C++?','programming',4,'','C++, C, Java, and MATLAB, are all imperative languages. Haskell is a functional language.',1,'2017-05-12 02:35:27.589171','2017-05-12 02:35:27.589179');
INSERT INTO "quiz_question" VALUES(382,'Which of the following is NOT a programming language?','programming',4,'','CGI stands for Common Gateway Interface, a standard for dynamic generation of web pages by a web server. It is NOT a programming language.',1,'2017-05-12 02:35:27.617122','2017-05-12 02:35:27.617131');
INSERT INTO "quiz_question" VALUES(383,'Can you parse an HTML document using regular expressions?','programming',4,'','Regular expressions can only match regular languages but HTML is a context-free language. It is always possible to present a HTML file that will be matched wrongly by any regular expression.',1,'2017-05-12 02:35:27.646829','2017-05-12 02:35:27.646842');
INSERT INTO "quiz_question" VALUES(384,'Which is a good reason to use a LinkedList instead of an ArrayList?','programming',4,'','In a linked list, elements are chained together: each element has a pointer to the next. Insert and remove operations are more memory-efficient compared to an ArrayList, at the cost that random access of elements is less efficient.',1,'2017-05-12 02:35:27.672894','2017-05-12 02:35:27.672900');
INSERT INTO "quiz_question" VALUES(385,'What is the advantage of using an ArrayList instead of a LinkedList?','programming',4,'','Elements in an ArrayList can be accessed directly by a numeric index, but in a LinkedList you must travers the elements from the start or the end until the desired element.',1,'2017-05-12 02:35:27.700491','2017-05-12 02:35:27.700497');
INSERT INTO "quiz_question" VALUES(386,'In web programming, what is the QUERY_STRING?','programming',4,'','The QUERY_STRING is the part of a URL after the question mark, not including the question mark itself, for example "search=hello&page=2".',1,'2017-05-12 02:35:27.737573','2017-05-12 02:35:27.737579');
INSERT INTO "quiz_question" VALUES(387,'Which one of these is NOT a common CGI environment variable?','programming',4,'','HTTP_USER_AGENT is the browser type of the visitor, HTTP_REFERER is the URL of the page that called the current one, and DOCUMENT_ROOT is the root directory of the server.',1,'2017-05-12 02:35:27.762368','2017-05-12 02:35:27.762374');
INSERT INTO "quiz_question" VALUES(388,'Which one of these is a common CGI environment variable?','programming',4,'','REMOTE_ADDR is the IP address of the visitor.',1,'2017-05-12 02:35:27.789317','2017-05-12 02:35:27.789323');
INSERT INTO "quiz_question" VALUES(389,'Which HTTP method was not part of the HTTP/1.0 specification?','programming',4,'','The OPTIONS method was added in the HTTP/1.1 specification.',1,'2017-05-12 02:35:27.821068','2017-05-12 02:35:27.821074');
INSERT INTO "quiz_question" VALUES(390,'What is the difference between the HTTP GET and HEAD methods?','programming',4,'','The response of a HEAD requests is a header identical to that of a GET request, but without a response body.',1,'2017-05-12 02:35:27.849046','2017-05-12 02:35:27.849052');
INSERT INTO "quiz_question" VALUES(391,'What is the status code of a successful HTTP request?','programming',4,'','"200 OK" is the standard response for successful HTTP requests.',1,'2017-05-12 02:35:27.877774','2017-05-12 02:35:27.877781');
INSERT INTO "quiz_question" VALUES(392,'Which one of these server responses is NOT part of the HTTP standard?','programming',4,'','404 is part of the standard but it means something else: "Not Found"',1,'2017-05-12 02:35:27.911424','2017-05-12 02:35:27.911431');
INSERT INTO "quiz_question" VALUES(393,'The 4xx class of HTTP status code indicates which type of error?','programming',4,'','Status codes in the class 4xx all indicate some kind of client error, such as requesting a non-existent page, or a syntax error in the request, just to name a few.',1,'2017-05-12 02:35:27.944832','2017-05-12 02:35:27.944838');
INSERT INTO "quiz_question" VALUES(394,'What was the limit of the header size in the HTTP/1.0 standard?','programming',4,'','The standard itself does not set a limit on the header size, but most implementations impose some limits for practical and security reasons.',1,'2017-05-12 02:35:27.970143','2017-05-12 02:35:27.970150');
INSERT INTO "quiz_question" VALUES(395,'What can you do with HTTP POST that you cannot do with HTTP GET?','programming',4,'','Uploading a file requires enclosing an entity in the request, which is supported by a POST request but not by a GET request.',1,'2017-05-12 02:35:28.003413','2017-05-12 02:35:28.003419');
INSERT INTO "quiz_question" VALUES(396,'Which of these build tools is the oldest?','build-automation',4,'','Make appeared in 1977, Ant in 2000, Maven in 2002, and CMake in 1999.',1,'2017-05-12 02:35:28.032503','2017-05-12 02:35:28.032510');
INSERT INTO "quiz_question" VALUES(397,'What is NOT a main responsibility of an automated build system?','build-automation',4,'','Debugging is an activity that involves interacting with a running program, not really part of the build process.',1,'2017-05-12 02:35:28.063562','2017-05-12 02:35:28.063570');
INSERT INTO "quiz_question" VALUES(398,'In an automated build system, which of these is the most logical next step after running unit tests?','build-automation',4,'','The software must already be compiled to run unit tests. Without a package, what is there to install or deploy?',1,'2017-05-12 02:35:28.094425','2017-05-12 02:35:28.094432');
INSERT INTO "quiz_question" VALUES(399,'What is the traditional step between "./configure" and "make install" when building a software from a source tarball?','build-automation',4,'','"make" without any arguments runs the default build task, which is typically building the entire software. This step is usually after the configuration step. After this the software can be installed with "make install".',1,'2017-05-12 02:35:28.117720','2017-05-12 02:35:28.117726');
INSERT INTO "quiz_question" VALUES(400,'What is the purpose of the "clean" step in a typical automated build system?','build-automation',4,'','The "clean" step typically removes build products, with the intention to start over as if the "compile" or other build steps were never executed.',1,'2017-05-12 02:35:28.145692','2017-05-12 02:35:28.145698');
INSERT INTO "quiz_question" VALUES(401,'What is the weakest point in the computer security of a typical large firm?','security',4,'','The typical weakest point is the employees, as social engineering and human gallibility can often circumvent otherwise state of the art computer security system.',1,'2017-05-12 02:35:28.195220','2017-05-12 02:35:28.195227');
INSERT INTO "quiz_question" VALUES(402,'Which of these is the most dangerous security probing tool?','security',4,'','nmap is a sophisticated port scanner, and can reveal much more about a network than all the other tools combined.',1,'2017-05-12 02:35:28.223770','2017-05-12 02:35:28.223778');
INSERT INTO "quiz_question" VALUES(403,'What''s the worst thing that can happen if you configure nmap with suid root?','security',4,'','Privilege escalation could be used to create all the other damages. Except maybe releasing the kraken. Not sure.',1,'2017-05-12 02:35:28.256228','2017-05-12 02:35:28.256235');
INSERT INTO "quiz_question" VALUES(404,'In Linux, what is the best way to give read permission to everybody on a file?','security',4,'','The +r flag gives read permission to everybody on the system. 444 is not a good idea because it removes all other permissions that there might have been. Anybody taking the other options should be fired on the spot.',1,'2017-05-12 02:35:28.301995','2017-05-12 02:35:28.302002');
INSERT INTO "quiz_question" VALUES(405,'Which is the worst method for encrypting data?','security',4,'','sha1 is not an encryption method but a message digest method. The next worst method here is crypt, if you wanted to know... :)',1,'2017-05-12 02:35:28.328845','2017-05-12 02:35:28.328852');
INSERT INTO "quiz_question" VALUES(406,'What''s the scariest defect that can happen in a web application?','security',4,'','A buffer overflow can potentially lead to privilege escalation, which could be used to produce all the others and much worse.',1,'2017-05-12 02:35:28.360774','2017-05-12 02:35:28.360781');
INSERT INTO "quiz_question" VALUES(407,'Which C library function is the least unsafe?','security',4,'','Only the strncpy function checks bounds, the others don''t. Not checking bounds is very likely to lead to buffer overflow defects.',1,'2017-05-12 02:35:28.390457','2017-05-12 02:35:28.390464');
INSERT INTO "quiz_question" VALUES(408,'Which tool cannot be used to encrypt files?','security',4,'','encfs and TrueCrypt can be used to create encrypted directories, and openssl can be used to encrypt a stream of data. nmap is a network scanning tool, not for encryption.',1,'2017-05-12 02:35:28.423329','2017-05-12 02:35:28.423336');
INSERT INTO "quiz_question" VALUES(409,'Which tool cannot be used to find open ports in the local system?','security',4,'','ping can only send ICMP ECHO requests to hosts, it cannot be used to find open ports.',1,'2017-05-12 02:35:28.455344','2017-05-12 02:35:28.455351');
INSERT INTO "quiz_question" VALUES(410,'Which tool cannot be used to find open ports in a remote system?','security',4,'','Unlike the others, netstat cannot be used to scan arbitrary remote ports.',1,'2017-05-12 02:35:28.483446','2017-05-12 02:35:28.483453');
INSERT INTO "quiz_question" VALUES(411,'Which one of these is NOT a Version Control System?','version-control',4,'','CSV stands for Comma Separated Values, it is a common file format, not a Version Control System.',1,'2017-05-12 02:35:28.524203','2017-05-12 02:35:28.524210');
INSERT INTO "quiz_question" VALUES(412,'Which one of these is a Distributed Version Control System?','version-control',4,'','These are all version control systems, but only Mercurial has a distributed model, the others use a client-server model.',1,'2017-05-12 02:35:28.553607','2017-05-12 02:35:28.553614');
INSERT INTO "quiz_question" VALUES(413,'What can be a disadvantage of a distributed VCS in comparison to a centralized VCS?','version-control',4,'','In a distributed VCS, initial cloning is typically slower, as the tool must download the entire project history. The other choices are disadvantages of centralized VCS.',1,'2017-05-12 02:35:28.581708','2017-05-12 02:35:28.581715');
INSERT INTO "quiz_question" VALUES(414,'In a version control system, which type of conflict can have an automatic resolution when merging branchA into branchB?','version-control',4,'','If branchA and branchB edited completely different parts of the file, that should be possible to resolve automatically. The other types of conflict require an explicit decision and action by a human.',1,'2017-05-12 02:35:28.611685','2017-05-12 02:35:28.611691');
INSERT INTO "quiz_question" VALUES(415,'What version control operation requires access to the server in a centralized VCS?','version-control',4,'','In a centralized VCS all operations that involve the history need to access the repository on the central server. The status, add, and mv commands can be performed without access to the server.',1,'2017-05-12 02:35:28.642605','2017-05-12 02:35:28.642612');
INSERT INTO "quiz_question" VALUES(416,'What is the most likely cause of a stack overflow?','programming',4,'','A common cause of a stack overflow is very deep or infinite recursion, exhausting the address space of the call stack. A common solution is to improve the algorithm to reduce the depth of recursions.',1,'2017-05-12 02:35:28.677164','2017-05-12 02:35:28.677170');
INSERT INTO "quiz_question" VALUES(417,'Which Linux distribution appeared first?','linux',4,'','Knoppix, Ubuntu, Mint are all derivatives of Debian.',1,'2017-05-12 02:35:28.714761','2017-05-12 02:35:28.714776');
INSERT INTO "quiz_question" VALUES(418,'Which command can be used to configure a firewall in Linux?','linux',3,'','iptables is an administration tool for IPv4 packet filtering and NAT, a common firewall software in Linux.',1,'2017-05-12 02:35:28.750453','2017-05-12 02:35:28.750460');
INSERT INTO "quiz_question" VALUES(419,'In Linux, which command cannot be used to list the files in a directory?','linux',4,'','The dirs command shows the list of remembered directories (stored by the pushd command), it cannot be used to list the files in a directory.',1,'2017-05-12 02:35:28.781916','2017-05-12 02:35:28.781922');
INSERT INTO "quiz_question" VALUES(420,'Which is an example of input redirection in common shells?','linux',3,'','"<" is the input redirection operator in common shells, even in DOS.',1,'2017-05-12 02:35:28.818409','2017-05-12 02:35:28.818419');
INSERT INTO "quiz_question" VALUES(421,'Which environment variable in Linux is typically not an absolute path?','linux',4,'','LOGNAME is usually the username of the current user, not a path.',1,'2017-05-12 02:35:28.849488','2017-05-12 02:35:28.849503');
INSERT INTO "quiz_question" VALUES(422,'Which command cannot be used to send an email in Linux?','linux',4,'','groff is a document formatting system (for example rendering man pages) and cannot be used to send emails. Yes you can send an email with telnet, though it won''t be pretty.',1,'2017-05-12 02:35:28.879331','2017-05-12 02:35:28.879338');
INSERT INTO "quiz_question" VALUES(423,'In Linux, which file controls the number of available virtual terminals?','linux',4,'','The virtual terminals are configured in the /etc/inittab file.',1,'2017-05-12 02:35:28.919389','2017-05-12 02:35:28.919396');
INSERT INTO "quiz_question" VALUES(424,'In Linux, what information is usually NOT stored in /etc/passwd file?','linux',4,'','The password is usually stored in /etc/shadow, with more strict access permissions.',1,'2017-05-12 02:35:28.958859','2017-05-12 02:35:28.958866');
INSERT INTO "quiz_question" VALUES(425,'In Linux, which runlevel is a multi-user runlevel?','linux',4,'','Runlevels 2 to 5 are multi-user runlevels.',1,'2017-05-12 02:35:28.986356','2017-05-12 02:35:28.986364');
INSERT INTO "quiz_question" VALUES(426,'In Linux, what is the name of the process with PID 1?','linux',4,'','In Linux the "init" process is the parent of all processes, it gets the first PID which is 1.',1,'2017-05-12 02:35:29.016955','2017-05-12 02:35:29.016962');
INSERT INTO "quiz_question" VALUES(427,'In Linux, which signal cannot be trapped?','linux',4,'','The KILL signal is non-catchable, non-ignorable, immediately kills a process without possibility of cleaning up.',1,'2017-05-12 02:35:29.044893','2017-05-12 02:35:29.044901');
INSERT INTO "quiz_question" VALUES(428,'In Linux, which command can be used to check if a given PID is currently running or not?','linux',4,'','The output of kill -0 PID includes the text "No such process" if the process doesn''t exist. The command exits with 1 if the process does not exist or the user does not own it.',1,'2017-05-12 02:35:29.078837','2017-05-12 02:35:29.078845');
INSERT INTO "quiz_question" VALUES(429,'Read the following sentence, and choose an answer that the sentence describes: ''The desktop environment runs on the client, using hardware emulation (or hardware virtualization).''','virtualization',3,'','Local Desktop virtualization uses software to emulate hardware, for example, a specific processor or processor architecture.',1,'2017-05-12 02:35:29.105718','2017-05-12 02:35:29.105739');
INSERT INTO "quiz_question" VALUES(430,'What is ''User virtualization?''','virtualization',3,'','User virtualization is the central storage of a users profile, data and settings in such a way that it is seperate to the Operating System.',1,'2017-05-12 02:35:29.141076','2017-05-12 02:35:29.141084');
INSERT INTO "quiz_question" VALUES(431,'What is the purpose of a Hypervisor?','virtualization',4,'','A Hypervisor can be software or hardware.',1,'2017-05-12 02:35:29.186525','2017-05-12 02:35:29.186531');
INSERT INTO "quiz_question" VALUES(432,'What is VMWare Horizon View Client used for?','virtualization',3,'','VMWare Horizon View is a desktop virtualization product. The client allows the user to connect to their virtual desktop, which runs on a server.',1,'2017-05-12 02:35:29.221942','2017-05-12 02:35:29.221948');
INSERT INTO "quiz_question" VALUES(433,'What is Hyper-V?','virtualization',3,'','Hyper-V is used to create virtual machines.',1,'2017-05-12 02:35:29.251519','2017-05-12 02:35:29.251526');
INSERT INTO "quiz_question" VALUES(434,'When referring to desktop virtualization, what is a host?','virtualization',3,'','The host will run a hypervisor, which controls one or more virtual machines.',1,'2017-05-12 02:35:29.281495','2017-05-12 02:35:29.281502');
INSERT INTO "quiz_question" VALUES(435,'What is a thin client?','virtualization',1,'','A thin client requires only a small amount of computational power compared to a standard desktop computer (or fat client). Without a server, a thin client is almost useless.',1,'2017-05-12 02:35:29.310497','2017-05-12 02:35:29.310503');
INSERT INTO "quiz_question" VALUES(436,'What is vSphere?','virtualization',3,'','vSphere is developed by VMWare.',1,'2017-05-12 02:35:29.342980','2017-05-12 02:35:29.342987');
INSERT INTO "quiz_question" VALUES(437,'What is Citrix XenApp used for?','virtualization',1,'','XenApp applications are hosted on a server, and can be streamed or run remotely.',1,'2017-05-12 02:35:29.383440','2017-05-12 02:35:29.383447');
INSERT INTO "quiz_question" VALUES(438,'Which is NOT true of cloud computing?','virtualization',1,'','Data is actually usually stored centrally on a server. Without a connection to the server,  current data is not accessible.',1,'2017-05-12 02:35:29.416469','2017-05-12 02:35:29.416477');
INSERT INTO "quiz_question" VALUES(439,'Which of the following is NOT a hypervisor?','virtualization',3,'','Cisco HV-Machine is made up. All the others are real hypervisors (ESX is type I/native/bare metal, and Virtualbox and Hyper-V are type II/hosted).',1,'2017-05-12 02:35:29.445400','2017-05-12 02:35:29.445407');
INSERT INTO "quiz_question" VALUES(440,'What are the two main types of hypervisor?','virtualization',3,'','A native hypervisor runs as an operating system directly on the server. A hosted hypervisor runs on top of another operating system.',1,'2017-05-12 02:35:29.477391','2017-05-12 02:35:29.477397');
INSERT INTO "quiz_question" VALUES(441,'What is the difference between type I and type II hypervisors?','virtualization',3,'','Each has it''s own advantages and disadvantages, and is useful depending on the environment and needs.',1,'2017-05-12 02:35:29.504902','2017-05-12 02:35:29.504910');
INSERT INTO "quiz_question" VALUES(442,'Which of the following is a Type I/native/bare metal hypervisor?','virtualization',3,'','RHEV is the only type I hypervisor in this list. VirtualBox and Virtual PC are type II hypervisors, and V-MAN-Pro is made up.',1,'2017-05-12 02:35:29.533863','2017-05-12 02:35:29.533869');
INSERT INTO "quiz_question" VALUES(443,'Which of the following is a Type II/hosted hypervisor?','virtualization',3,'','VMware Workstation is a type II/hosted hypervisor (it runs directly on top of another operating system), whereas all the others are type I/native/bare metal hypervisors, which means they run directly on the server hardware.',1,'2017-05-12 02:35:29.566449','2017-05-12 02:35:29.566455');
INSERT INTO "quiz_question" VALUES(444,'Which of the following is a hypervisor, developed by Microsoft?','virtualization',1,'','Microsoft developed the type I/native/bare metal hypervisor named Hyper-V.',1,'2017-05-12 02:35:29.604141','2017-05-12 02:35:29.604147');
INSERT INTO "quiz_question" VALUES(445,'What does UE-V stand for in Microsoft UE-V?','virtualization',3,'','Microsoft UE-V allows user settings and preferences to roam with the user on various devices.',1,'2017-05-12 02:35:29.630359','2017-05-12 02:35:29.630366');
INSERT INTO "quiz_question" VALUES(446,'Which of the following is UE-V mainly concerned with?','virtualization',3,'','Microsoft UE-V (User Experience Virtualization) is used to allow user''s settings and preferences to roam with them on different devices.',1,'2017-05-12 02:35:29.667325','2017-05-12 02:35:29.667331');
INSERT INTO "quiz_question" VALUES(447,'Which of the following is NOT part of the Microsoft Windows NT family of operating systems?','windows',1,'','Windows 98 was not part of the Windows NT family, the others are.',1,'2017-05-12 02:35:29.696360','2017-05-12 02:35:29.696366');
INSERT INTO "quiz_question" VALUES(448,'In which year was windows 10 released?','windows',1,'','It was released to consumers in July 2015.',1,'2017-05-12 02:35:29.727822','2017-05-12 02:35:29.727836');
INSERT INTO "quiz_question" VALUES(449,'What is name of the web browser included in Windows 10?','windows',1,'','Microsoft''s new browser, Edge, was included at release. It was codenamed Spartan during development.',1,'2017-05-12 02:35:29.752980','2017-05-12 02:35:29.752985');
INSERT INTO "quiz_question" VALUES(450,'During development, which Microsoft operating system was codenamed Blackcomb?','windows',1,'','Windows 7 was codenamed Blackcomb during development',1,'2017-05-12 02:35:29.776590','2017-05-12 02:35:29.776597');
INSERT INTO "quiz_question" VALUES(451,'What does WDDM stand for?','windows',3,'','WDDM is a graphic driver architecture',1,'2017-05-12 02:35:29.813286','2017-05-12 02:35:29.813293');
INSERT INTO "quiz_question" VALUES(452,'What is the name of Window''s 10''s intelligent personal assistant?','windows',1,'','The assistant''s name is Cortana, named after a character from the Halo game franchise.',1,'2017-05-12 02:35:29.842465','2017-05-12 02:35:29.842472');
INSERT INTO "quiz_question" VALUES(453,'Who developed the file system ReFS?','os',1,'','ReFS is a file system developed by Microsoft. ReFS stands for Resilient File System.',1,'2017-05-12 02:35:29.870718','2017-05-12 02:35:29.870725');
INSERT INTO "quiz_question" VALUES(454,'What does ReFS stand for?','os',1,'','Resilient File System - it is a file system developed by Microsoft.',1,'2017-05-12 02:35:29.901253','2017-05-12 02:35:29.901260');
INSERT INTO "quiz_question" VALUES(455,'Which file system was used in the original release of Windows 10?','windows',1,'','NTFS was still used, as ReFS was not yet ready.',1,'2017-05-12 02:35:29.929901','2017-05-12 02:35:29.929910');
INSERT INTO "quiz_question" VALUES(456,'Who developed powershell?','windows',1,'','Microsoft developed PowerShell to be used with it''s operating systems.',1,'2017-05-12 02:35:29.955366','2017-05-12 02:35:29.955377');
INSERT INTO "quiz_question" VALUES(457,'What browser is the Tor browser based on?','network',1,'','The Tor browser is based on Mozilla Firefox.',1,'2017-05-12 02:35:29.981356','2017-05-12 02:35:29.981362');
INSERT INTO "quiz_question" VALUES(458,'What is Tor?','network',1,'','It is an anonymity network. Tor originally stood for The Onion Router.',1,'2017-05-12 02:35:30.017179','2017-05-12 02:35:30.017191');
INSERT INTO "quiz_question" VALUES(459,'What did the acronym Tor originally stand for?','network',1,'','The Onion Router. Tor is an anonymity network.',1,'2017-05-12 02:35:30.055785','2017-05-12 02:35:30.055793');
INSERT INTO "quiz_question" VALUES(460,'What is a cmdlet?','programming',1,'','A cmdlet is a lightweight command in PowerShell, that performs a certain action.',1,'2017-05-12 02:35:30.080951','2017-05-12 02:35:30.080964');
INSERT INTO "quiz_question" VALUES(461,'Which one of the following is NOT an edition of Windows 10?','os',1,'','Home Plus is not an edition of Windows 10.',1,'2017-05-12 02:35:30.116718','2017-05-12 02:35:30.116733');
INSERT INTO "quiz_question" VALUES(462,'Which of the following IS a version of Windows 10?','os',1,'','Eduation is an edition of Windows 10, the others are not.',1,'2017-05-12 02:35:30.148873','2017-05-12 02:35:30.148893');
