INSERT INTO "quiz_question" VALUES(464,'Which version of Windows 10 CANNOT join a domain?','os',1,'','The home version cannot be used to join a domain, while all the others can.',1,'2017-05-12 02:35:30.203856','2017-05-12 02:35:30.203862');
INSERT INTO "quiz_question" VALUES(465,'Which version of Windows 10 comes with AppLocker?','os',1,'','Only Enterprise and Education ship with AppLocker, the others do not.',1,'2017-05-12 02:35:30.248494','2017-05-12 02:35:30.248502');
INSERT INTO "quiz_question" VALUES(466,'Where did the X in Xbox originate?','os',1,'','It used DirectX technology, hence the X.',1,'2017-05-12 02:35:30.285857','2017-05-12 02:35:30.285864');
INSERT INTO "quiz_question" VALUES(467,'What does MDM stand for?','hardware',1,'','MDM stands for Mobile Device Management. It can be used to track devices, remotely wipe them, control access etc.',1,'2017-05-12 02:35:30.314657','2017-05-12 02:35:30.314665');
INSERT INTO "quiz_question" VALUES(468,'What is the codename used during development of Microsoft Edge?','windows',3,'','Edge was codenamed Spartan, named after Spartans from the Halo game franchise.',1,'2017-05-12 02:35:30.346064','2017-05-12 02:35:30.346071');
INSERT INTO "quiz_question" VALUES(469,'Which version of DirectX was included in the original release of Windows 10?','windows',3,'','DirectX 12 was released alongside Windows 10.',1,'2017-05-12 02:35:30.373376','2017-05-12 02:35:30.373384');
INSERT INTO "quiz_question" VALUES(470,'Which version of WDDM was included in the original release of Windows 10?','windows',3,'','WDDM stands for Windows Display Driver Model. Version 2.0 was released with Windows 10.',1,'2017-05-12 02:35:30.404400','2017-05-12 02:35:30.404407');
INSERT INTO "quiz_question" VALUES(471,'What does CIM stand for?','hardware',3,'','It is a standard for representing IT elements and their relationships.',1,'2017-05-12 02:35:30.431853','2017-05-12 02:35:30.431861');
INSERT INTO "quiz_question" VALUES(472,'What does DMTF stand for?','hardware',3,'','DMTF is a standards development organisaton comprising a number of technology companies.',1,'2017-05-12 02:35:30.471357','2017-05-12 02:35:30.471365');
INSERT INTO "quiz_question" VALUES(473,'What does the WS stand for in WS-Management?','os',3,'','Web Services-Management is a standard developed by DMTF.',1,'2017-05-12 02:35:30.507775','2017-05-12 02:35:30.507780');
INSERT INTO "quiz_question" VALUES(474,'Which of the following is based on the .NET framework?','programming',3,'','PowerShell is based on .NET Framework technology.',1,'2017-05-12 02:35:30.540531','2017-05-12 02:35:30.540537');
INSERT INTO "quiz_question" VALUES(475,'In PowerShell, how would you get a list of available cmdlets?','programming',3,'','Get-Command will list the available cmdlets.',1,'2017-05-12 02:35:30.572631','2017-05-12 02:35:30.572645');
INSERT INTO "quiz_question" VALUES(476,'In PowerShell, how would you get a description of a specific cmdlet?','programming',3,'','Get-Help <cmdlet> is the correct command. For example, ''Get-Help Get-Date'' where ''Get-Date'' is the name of the cmdlet.',1,'2017-05-12 02:35:30.606499','2017-05-12 02:35:30.606506');
INSERT INTO "quiz_question" VALUES(477,'What is the naming convention for PowerShell cmdlets?','programming',3,'','Verb-Noun - for example ''Get-Help'' is a cmdlet. The verb describes the action and the noun describes the type of object it acts on.',1,'2017-05-12 02:35:30.635726','2017-05-12 02:35:30.635732');
INSERT INTO "quiz_question" VALUES(478,'Who developed the programming language Go?','programming',3,'','Go was developed by Google in 2007.',1,'2017-05-12 02:35:30.661363','2017-05-12 02:35:30.661369');
INSERT INTO "quiz_question" VALUES(479,'What do C# applications run on?','programming',1,'','C# (C sharp) applictions run on Microsoft''s .NET Framework',1,'2017-05-12 02:35:30.693191','2017-05-12 02:35:30.693198');
INSERT INTO "quiz_question" VALUES(480,'What is PHP?','programming',3,'','PHP is a server side scripting language. It is primarily used for web development but has other uses too.',1,'2017-05-12 02:35:30.726209','2017-05-12 02:35:30.726215');
INSERT INTO "quiz_question" VALUES(481,'What is IPC?','os',3,'','IPC allows for processes to share data.',1,'2017-05-12 02:35:30.753493','2017-05-12 02:35:30.753500');
INSERT INTO "quiz_question" VALUES(482,'What can a managed switch do that an unmanaged switch can''t?','network',3,'','A managed switch is typically much more expensive, but is much more flexible for business needs.',1,'2017-05-12 02:35:30.781826','2017-05-12 02:35:30.781833');
INSERT INTO "quiz_question" VALUES(483,'What is the name of the operating system family that runs on modern Cisco network routers and switches?','network',1,'','Cisco IOS runs on Cisco routers and modern switches. Some older switches ran CatOS.',1,'2017-05-12 02:35:30.810206','2017-05-12 02:35:30.810225');
INSERT INTO "quiz_question" VALUES(484,'What does DaaS stand for (in terms of virtual desktop provision)?','virtualization',1,'','With DaaS, storage, processing power and other services such as backups, are provided by the service provider.',1,'2017-05-12 02:35:30.835852','2017-05-12 02:35:30.835858');
INSERT INTO "quiz_question" VALUES(485,'What is sideloading?','hardware',1,'','Sideloading is to install software (for example on a mobile phone or device) by first connecting to a computer in order to install. It can be compared to uploading and downloading, but uses it''s local connection to a computer, for example, to provide the installer, rather that directly downloading files.',1,'2017-05-12 02:35:30.864994','2017-05-12 02:35:30.865000');
INSERT INTO "quiz_question" VALUES(486,'What does it mean to slipstream drivers?','os',3,'','Slipstreaming drivers is to include them into the installation media/image of an Operating System.',1,'2017-05-12 02:35:30.894812','2017-05-12 02:35:30.894818');
INSERT INTO "quiz_question" VALUES(487,'In bash, what does the command ''pwd'' do?','os',3,'','''pwd'' stands for Print Working Directory, and displays the current directory.',1,'2017-05-12 02:35:30.931672','2017-05-12 02:35:30.931683');
INSERT INTO "quiz_question" VALUES(488,'In Windows, if a batch file contains the line ''cd %~dp0'', what will it do?','programming',3,'','It will switch the current directory to that of the batch file in use.',1,'2017-05-12 02:35:30.963309','2017-05-12 02:35:30.963334');
INSERT INTO "quiz_question" VALUES(489,'Which bash command can be used to create a file, or update the modify time of an existing file?','os',3,'','The touch command can create a file or update its modify time.',1,'2017-05-12 02:35:30.994743','2017-05-12 02:35:30.994751');
INSERT INTO "quiz_question" VALUES(490,'What is Microsoft Azure?','virtualization',3,'','Azure is a cloud computing platform developed by Microsoft',1,'2017-05-12 02:35:31.026833','2017-05-12 02:35:31.026848');
INSERT INTO "quiz_question" VALUES(491,'Which of the following is NOT a Linux distribution?','os',1,'','Grub is a boot loader, not a Linux distribution',1,'2017-05-12 02:35:31.056581','2017-05-12 02:35:31.056588');
INSERT INTO "quiz_question" VALUES(492,'Which bash command will update software repository locations?','linux',1,'','Apt-get update will update the location of software repositories (which are used to install software).',1,'2017-05-12 02:35:31.091713','2017-05-12 02:35:31.091744');
INSERT INTO "quiz_question" VALUES(493,'In bash, which operator can be used to place multiple commands on one line, so that they run in order?','programming',3,'','&& can be used to run multiple commands on one line.',1,'2017-05-12 02:35:31.124375','2017-05-12 02:35:31.124384');
INSERT INTO "quiz_question" VALUES(494,'What are the following examples of: ''bash'', ''tcsh'', ''ksh''?','linux',1,'','They are all Linux shells.',1,'2017-05-12 02:35:31.158353','2017-05-12 02:35:31.158361');
