INSERT INTO "quiz_question" VALUES(497,'What does the command ''chmod'' do in a Linux environment?','linux',3,'','It is used to modify permissions on a file.',1,'2017-05-12 02:35:31.249784','2017-05-12 02:35:31.249798');
INSERT INTO "quiz_question" VALUES(498,'What does the command ''chown'' do in a Linux environment?','linux',3,'','''chown'' can change the ownership of a file in Linux.',1,'2017-05-12 02:35:31.279389','2017-05-12 02:35:31.279397');
INSERT INTO "quiz_question" VALUES(499,'Which statement below is true of Linux?','linux',1,'','Linux is a Unix-like operating system, however it is not the same as Unix.',1,'2017-05-12 02:35:31.310620','2017-05-12 02:35:31.310628');
